11384=>["Value"=>11384,"TextKey"=>"图鉴描述10501","TextValue"=>"The King of the Hill Kingdom. A total sweet tooth. He's loved by the people for being happy-go-lucky, amiable and charismatic."],
11385=>["Value"=>11385,"TextKey"=>"图鉴描述10502","TextValue"=>"Universamente conosciuta come la più grande maga del tempo  Dotata di genialità fertile, benevolenza, amabilità e perspicacia. Di tutti i travestimenti, si trasforma solitamente in un coniglio, e solo alcuni hanno visto la sua faccia reale dietro la magia "],
11386=>["Value"=>11386,"TextKey"=>"图鉴描述10503","TextValue"=>"Il leggendario cantastorie e compositore di musica della tribù Mentre vagava tra i cieli e le terre, mai nessuno lo ha mai visto in giro Con la sua voce profonda e il giudizio, sono stati cantati molti elogi  "],
11387=>["Value"=>11387,"TextKey"=>"图鉴描述10504","TextValue"=>"Puro e penoso Pieno di curiosità sul mondo esterno, ama suonare la batteria ogni volta che si sente espressiva "],
11388=>["Value"=>11388,"TextKey"=>"图鉴描述10505","TextValue"=>"Il Re di tutti i leoni e cammina come un umano Una volta ha perso la sua fantastica patria insieme ai membri della tribù, ma con la sua forza eccezionale, testimonianza e coraggio, un vero leader lo riporterà indietro alla fine. "],
11389=>["Value"=>11389,"TextKey"=>"图鉴描述10506","TextValue"=>"Walked out of a heartbreaking past, she becomes stronger and more optimistic. She also learnt a magic that can makes visions in match flames come true."],
11390=>["Value"=>11390,"TextKey"=>"图鉴描述10507","TextValue"=>"He's wee stingy and naughty. Was once cursed by the Witch because of his prank. With a pumpkin head, he becomes more kind, often holding a lantern to light passers-by in the dark."],
