12687=>["Value"=>12687,"TextKey"=>"新手引导说明2012","TextValue"=>"<line-height=130%>Tocca per ottenere consigli utili per il gioco. Prova!"],
12688=>["Value"=>12688,"TextKey"=>"新手引导说明2020","TextValue"=>"<line-height=130%>Se vuoi superare un livello, devi ottenere un <color=#f58c26>Oggetto designato</color>."],
12689=>["Value"=>12689,"TextKey"=>"新手引导说明2022","TextValue"=>"<line-height=130%>L'<color=#f58c26>Obiettivo di livello</color> ti dirà cosa devi ottenere. Inizia a combinare e vinci!"],
12690=>["Value"=>12690,"TextKey"=>"新手引导说明2030","TextValue"=>"<line-height=120%>Wow, una <color=#ef933d>Giovane Embla intagliata</color>! Anche i loro poteri sono svaniti! Dobbiamo svegliare <color=#f58c26>Embla</color> combinando gli intagli."],
12691=>["Value"=>12691,"TextKey"=>"新手引导说明2031","TextValue"=>"Se un livello presenta queste incisioni, di solito puoi superarlo combinandole."],
12692=>["Value"=>12692,"TextKey"=>"新手引导说明2032","TextValue"=>"<line-height=130%>Queste lande hanno perso la loro connessione con la Dea e sono cadute in un sonno profondo."],
12693=>["Value"=>12693,"TextKey"=>"新手引导说明2033","TextValue"=>"<line-height=130%>Non puoi muovere nessun oggetto sulle <color=#38aec0>Lande dormienti</color>."],
12694=>["Value"=>12694,"TextKey"=>"新手引导说明2034","TextValue"=>"<line-height=130%>Combina un <color=#38c0a5>Fiore spirituale</color> qualsiasi per risvegliare la landa."],
12695=>["Value"=>12695,"TextKey"=>"新手引导说明2035","TextValue"=>"<line-height=130%>Quando vinci, <color=#f58c26>Dea Embla</color> sveglierà tutte le lande!"],
12696=>["Value"=>12696,"TextKey"=>"新手引导说明2040","TextValue"=>"<line-height=130%>Guarda! È un <color=#38c0a5>Totem</color>."],
12697=>["Value"=>12697,"TextKey"=>"新手引导说明2041","TextValue"=>"Sbrigati e combina <color=#38c0a5>Tre Totem</color> per salvare il membro della tribù intrappolato all'interno!"],
12698=>["Value"=>12698,"TextKey"=>"新手引导说明2050","TextValue"=>"Come abbiamo appena detto, puoi toccare un <color=#38c0a5>Globo runico selvaggio</color> per svegliare la landa."],
12699=>["Value"=>12699,"TextKey"=>"新手引导说明2051","TextValue"=>"<line-height=130%>Ovviamente, puoi anche combinarli per ottenerne di più avanzati!"],
12700=>["Value"=>12700,"TextKey"=>"新手引导说明2060","TextValue"=>"Puoi combinare gli oggetti sulle <color=#38aec0>Lande dormienti</color> con quelli delle lande normali per risvegliare automaticamente quelle dormienti."],
12701=>["Value"=>12701,"TextKey"=>"新手引导说明2070","TextValue"=>"Tocca un <color=#38c0a5>Gruppo di totem</color> per ottenere un <color=#38c0a5>Totem</color>."],
12702=>["Value"=>12702,"TextKey"=>"新手引导说明2080","TextValue"=>"Alcune <color=#38aec0>Super Lande dormienti</color> non possono essere risvegliate attraverso <color=#f58c26>Punti cura</color>, ma possono essere risvegliate solo attraverso la combinazione dei suoi oggetti con quelli delle lande normali."],
12703=>["Value"=>12703,"TextKey"=>"新手引导说明2090","TextValue"=>"<line-height=130%>D'ora in poi, i livelli avranno <color=#f58c26>Incarichi</color>."],
12704=>["Value"=>12704,"TextKey"=>"新手引导说明2091","TextValue"=>"<line-height=130%>Puoi controllare il <color=#38c0a5>Sole degli incarichi</color> per gli incarichi e le ricompense."],
12705=>["Value"=>12705,"TextKey"=>"新手引导说明2093","TextValue"=>"<line-height=130%>Questo pulsante può bloccare o sbloccare la <color=#f58c26>Funzione di trascinamento dello schermo</color>."],
12706=>["Value"=>12706,"TextKey"=>"新手引导说明2100","TextValue"=>"Alcuni oggetti non possono essere combinati direttamente. Tocca il <color=#ef933d>Mucchio di rocce cuneiformi</color> per dividerlo in <color=#ef933d>Rocce cuneiformi</color>, poi combinale. "],
12707=>["Value"=>12707,"TextKey"=>"新手引导说明2110","TextValue"=>"<line-height=130%>Devi controllare gli <color=#f58c26>Obiettivi di livello</color>."],
12708=>["Value"=>12708,"TextKey"=>"新手引导说明2130","TextValue"=>"<line-height=130%>Possiamo ottenere <color=#ef933d>Germogli di cespuglio</color> dalle <color=#38c0a5>Ossa di drago</color>."],
12709=>["Value"=>12709,"TextKey"=>"新手引导说明2140","TextValue"=>"Questa è un'enorme <color=#ef933d>Bomba di risveglio</color>. Se risvegli la landa accanto ad essa, si risveglierà automaticamente e risveglierà le tessere che la circondano direttamente."],
12710=>["Value"=>12710,"TextKey"=>"新手引导说明2150","TextValue"=>"I membri della tribù possono raccogliere per te <color=#38c0a5>Minerali selvaggi</color> da <color=#38c0a5>Viti</color> di livello superiore."],
12711=>["Value"=>12711,"TextKey"=>"新手引导说明2160","TextValue"=>"Questa è una <color=#ef933d>Tomba distrutta</color>. Se le trascuri o le combini, si trasformeranno in terrificanti <color=#df66a8>Zombi</color>. Sconfiggili per ottenere <color=#38c0a5>Lucciole</color>, necessarie per superare il livello."],
12712=>["Value"=>12712,"TextKey"=>"新手引导说明2170","TextValue"=>"Un <color=#ef933d>Nido abbandonato</color> genera costantemente zombie anche quando dormiente. Toccandolo, si genera immediatamente uno zombie! Distruggi gli zombie per ottenere <color=#38c0a5>Minerali selvaggi</color>."],
12713=>["Value"=>12713,"TextKey"=>"新手引导说明2180","TextValue"=>"Questo è un <color=#38c0a5>Portale runico del druido</color>, che fortuna! Combinalo per evocare un <color=#38c0a5>Membro tribale</color> dalla Terra natia per aiutarti."],
12714=>["Value"=>12714,"TextKey"=>"新手引导说明2190","TextValue"=>"La rimanenza dell'Albero Sacro della Creazione. Produce automaticamente <color=#38c0a5>Globi runici selvaggi</color>. Più alto è il livello, più forte è il potere di guarigione."],
12715=>["Value"=>12715,"TextKey"=>"新手引导说明2200","TextValue"=>" Delle <color=#ef933d>Nuvole</color> continueranno ad apparire qui. Toccale perché generino pioggia. Sotto di esse appariranno <color=#38c0a5>Pozzanghere</color> e <color=#38c0a5>Fiori spirituali</color>."],
12716=>["Value"=>12716,"TextKey"=>"新手引导说明2210","TextValue"=>"<line-height=130%>Strano... Dove sono le <color=#ef933d>Giovani Embla intagliate</color>?"],
12717=>["Value"=>12717,"TextKey"=>"新手引导说明2211","TextValue"=>"<line-height=130%>Oh, sì, se completi i tuoi <color=#f58c26>incarichi</color>, appariranno!"],
12718=>["Value"=>12718,"TextKey"=>"新手引导说明2220","TextValue"=>"Questa è una <color=#ef933d>Statua del Demone</color>. Un'opera orribile! Ordina alla tua gente di annullarla per ottenere una <color=#ef933d>Giovane Embla intagliata</color>."],
12719=>["Value"=>12719,"TextKey"=>"新手引导说明2230","TextValue"=>"<line-height=130%>Un nuovo Campo si è aperto! Cercalo sulla Mappa del mondo!"],
12720=>["Value"=>12720,"TextKey"=>"新手引导说明2240","TextValue"=>"<line-height=130%>Sono di nuovo libero! Grazie mille! "],
12721=>["Value"=>12721,"TextKey"=>"新手引导说明2241","TextValue"=>"<line-height=130%>La gente della nostra tribù è intrappolata in questi <color=#38c0a5>Totem</color>."],
12722=>["Value"=>12722,"TextKey"=>"新手引导说明2242","TextValue"=>"<line-height=130%>La tribù ha bisogno del tuo aiuto per trovare altri membri sia qui che a casa."],
12723=>["Value"=>12723,"TextKey"=>"新手引导说明2243","TextValue"=>"<line-height=130%>Cercali nel prossimo livello!"],
12724=>["Value"=>12724,"TextKey"=>"新手引导说明2250","TextValue"=>"Puoi <color=#f58c26>toccare due volte</color> alcuni oggetti per chiamare qualcuno che venga a raccogliere."],
12725=>["Value"=>12725,"TextKey"=>"新手引导说明2251","TextValue"=>"<line-height=130%>Puoi usare o combinare gli oggetti che hai raccolto."],
12726=>["Value"=>12726,"TextKey"=>"新手引导说明2252","TextValue"=>"<line-height=130%>Raccogli un <color=#38c0a5>Fiore spirituale</color> per ottenere un <color=#38c0a5>Globo runico selvaggio</color>."],
12727=>["Value"=>12727,"TextKey"=>"新手引导说明2253","TextValue"=>"<color=#f58c26>Tocca la sfera</color> per risvegliare <color=#38aec0>Le Lande dormienti</color>."],
12728=>["Value"=>12728,"TextKey"=>"新手引导说明2261","TextValue"=>"<line-height=130%>D'ora in poi, potrai selezionare le ricompense alla fine di ogni livello."],
12729=>["Value"=>12729,"TextKey"=>"新手引导说明2262","TextValue"=>"<line-height=130%>Le ricompense sono di solito <color=#38c0a5>Oro</color> o altre risorse utili. A volte anche un totem!"],
12730=>["Value"=>12730,"TextKey"=>"新手引导说明2263","TextValue"=>"<line-height=130%>Le tue ricompense saranno inserite in <color=#f58c26>Bolle</color> e spedite a casa."],
12731=>["Value"=>12731,"TextKey"=>"新手引导说明3000","TextValue"=>"<line-height=130%>Questa è la nostra <color=#f58c26>Terra natia</color>."],
12732=>["Value"=>12732,"TextKey"=>"新手引导说明3001","TextValue"=>"<line-height=130%>Questa era la nostra casa, prima che la <color=#f58c26>Grande Alluvione</color> distruggesse la nostra vita pacifica, lasciando una pesante nebbia a ricoprire la landa."],
12733=>["Value"=>12733,"TextKey"=>"新手引导说明3002","TextValue"=>"<line-height=105%>Combina oggetti con quelli sulle lande dormienti per risvegliare subito la landa! Tenta combinazioni per salvare più membri della tribù! Più grande è la tua popolazione, più nebbia puoi diradare e più velocemente puoi ricostruire la nostra casa."],
12734=>["Value"=>12734,"TextKey"=>"新手引导说明3005","TextValue"=>"<line-height=130%>Puoi sbloccare solo un <color=#38c0a5>Forziere del tesoro del tempo</color> alla volta. Aspetta la fine del conto alla rovescia per ottenerli, o spendi Rubini per ottenere qualsiasi <color=#38c0a5>Forziere del tesoro del tempo</color> immediatamente."],
12735=>["Value"=>12735,"TextKey"=>"新手引导说明3006","TextValue"=>"<line-height=130%>Le ricompense di livello sono arrivate! Apri le bolle e controllale!"],
12736=>["Value"=>12736,"TextKey"=>"新手引导说明3010","TextValue"=>"<line-height=130%>Le <color=#38c0a5>Case lunghe</color> sono luoghi dove i lavoratori possono riposarsi un po'. Usciranno dopo un certo periodo di tempo."],
12737=>["Value"=>12737,"TextKey"=>"新手引导说明3011","TextValue"=>"<line-height=130%>Le <color=#38c0a5>Case lunghe</color> possono essere combinate con quelle di livello superiore. Più alto è il livello, più breve è il tempo necessario ai membri della tribù per riposare all'interno."],
12738=>["Value"=>12738,"TextKey"=>"新手引导说明3016","TextValue"=>"<line-height=130%>Spendi <color=#38c0a5>Rubini</color> per svegliarli immediatamente."],
12739=>["Value"=>12739,"TextKey"=>"新手引导说明3030","TextValue"=>"Puoi completare più incarichi in Terra natia per ottenere più <color=#38c0a5>Eredità culturali dimenticate</color>. Toccale per ottenere ricompense speciali!"],
12740=>["Value"=>12740,"TextKey"=>"新手引导说明3040","TextValue"=>"<line-height=130%>Questo è un piccolo pezzo di <color=#38c0a5>Oro</color>."],
12741=>["Value"=>12741,"TextKey"=>"新手引导说明3041","TextValue"=>"<line-height=120%>Puoi toccarli per ottenere un po' di <color=#38c0a5>Oro</color>, o puoi combinarli in pepite d'oro più avanzate."],
12742=>["Value"=>12742,"TextKey"=>"新手引导说明3042","TextValue"=>"<line-height=130%>Puoi spendere il tuo <color=#38c0a5>Oro</color> al <color=#f58c26>Negozio</color>."],
12743=>["Value"=>12743,"TextKey"=>"新手引导说明3050","TextValue"=>"<line-height=130%>Troppo oro? Puoi andare a comprare della roba davvero interessante al negozio!"],
12744=>["Value"=>12744,"TextKey"=>"新手引导说明3060","TextValue"=>"<line-height=130%>Tutti i <color=#df66a8>Membri della tribù</color> sono troppo stanchi. Hanno bisogno di una pausa per ripristinare le loro energie."],
12745=>["Value"=>12745,"TextKey"=>"新手引导说明3061","TextValue"=>"<line-height=130%>È ora di battere altri livelli e salvare altre persone!"],
12746=>["Value"=>12746,"TextKey"=>"新手引导说明3062","TextValue"=>"<line-height=120%>Più membri della tribù hai, più risorse possono raccogliere per te prima di andare a dormire."],
12747=>["Value"=>12747,"TextKey"=>"新手引导说明3063","TextValue"=>"<line-height=130%>Supera i livelli per salvare più membri della tribù."],
12748=>["Value"=>12748,"TextKey"=>"新手引导说明3064","TextValue"=>"<line-height=130%>E riportali a casa!"],
12749=>["Value"=>12749,"TextKey"=>"新手引导说明3065","TextValue"=>"<line-height=130%>Guarda! Puoi andare al Campo toccando la <color=#f58c26>Mappa del mondo</color>."],
12750=>["Value"=>12750,"TextKey"=>"新手引导说明3070","TextValue"=>"<line-height=130%>Non c'è più spazio per nient'altro: il terreno è completamente coperto!"],
12751=>["Value"=>12751,"TextKey"=>"新手引导说明3071","TextValue"=>"<line-height=130%>Seleziona un oggetto, poi seleziona nella casella informazioni per venderlo o scartarlo. "],
12752=>["Value"=>12752,"TextKey"=>"新手引导说明3080","TextValue"=>"Questa è un'<color=#38c0a5>Eredità culturale aliena</color>, è estremamente rara! Toccala per ricevere <color=#38c0a5>Rubini</color>! Oppure puoi combinala per ottenerne di più avanzate!"],
12753=>["Value"=>12753,"TextKey"=>"新手引导说明3090","TextValue"=>"<line-height=130%>Questo è un pezzo di <color=#38c0a5>Minerale selvaggio</color>."],
12754=>["Value"=>12754,"TextKey"=>"新手引导说明3091","TextValue"=>"<line-height=130%>Puoi toccarli per raccogliere <color=#38c0a5>Minerali selvaggi</color>, oppure puoi combinarli per ottenerne di più avanzati!"],
12755=>["Value"=>12755,"TextKey"=>"新手引导说明3092","TextValue"=>"<line-height=130%>Puoi spendere i <color=#38c0a5>Minerali selvaggi</color> che hai raccolto nel <color=#f58c26>Negozio</color>."],
12756=>["Value"=>12756,"TextKey"=>"新手引导说明3100","TextValue"=>"<line-height=130%>Se il tuo magazzino di <color=#38c0a5>Minerali selvaggi</color> è troppo pieno, spendili nel Negozio."],
12757=>["Value"=>12757,"TextKey"=>"新手引导说明3110","TextValue"=>"Questa <color=#38c0a5>Barricata</color> mi dà molto fastidio! Ma non puoi spostarla direttamente. Ordina ai tuoi <color=#df66a8>Membri della tribù</color> di attaccarla per dividerla in barricate più piccole."],
12758=>["Value"=>12758,"TextKey"=>"新手引导说明3120","TextValue"=>"Le <color=#38c0a5>Barbette</color> contaminano le lande anche quando si trovano su lande dormienti. La <color=#f58c26>Barra del progresso</color> mostra quanto tempo passa tra un attacco e l'altro. Puoi attaccare solo una barbetta risvegliata."],
12759=>["Value"=>12759,"TextKey"=>"新手引导说明3130","TextValue"=>"Questo è un <color=#f58c26>Altare dell'Eroe</color>. Gli eroi passeranno tra <color=#f58c26>Modalità riposo</color> e <color=#f58c26>Modalità pattugliamento</color>."],
12760=>["Value"=>12760,"TextKey"=>"新手引导说明3131","TextValue"=>"Con un eroe in giro, ci saranno ulteriori sorprese per ogni <color=#f58c26>combinazione di 4 oggetti</color>!"],
12761=>["Value"=>12761,"TextKey"=>"新手引导说明3132","TextValue"=>"Se sono inattivi, puoi spendere <color=#38c0a5>Rubini</color> per svegliarli immediatamente."],
12762=>["Value"=>12762,"TextKey"=>"新手引导说明3133","TextValue"=>"Puoi cliccare qui per controllare alcune informazioni sull'eroe"],
12763=>["Value"=>12763,"TextKey"=>"新手引导说明3142","TextValue"=>"<line-height=130%>Gli eroi hanno abilità uniche in qualità di unità forti della tribù."],
12764=>["Value"=>12764,"TextKey"=>"新手引导说明3144","TextValue"=>"<line-height=130%>Puoi controllare le descrizioni delle abilità di un eroe qui nel <color=#f58c26>Box di Abilità eroe</color>."],
12765=>["Value"=>12765,"TextKey"=>"新手引导说明3145","TextValue"=>"<line-height=130%>Puoi far salire di livello gli eroi presentando <color=#f58c26>Missioni</color> finite."],
12766=>["Value"=>12766,"TextKey"=>"新手引导说明3147","TextValue"=>"Finisci tutte le missioni per far salire di livello il tuo eroe!"],
12767=>["Value"=>12767,"TextKey"=>"新手引导说明3150","TextValue"=>"<line-height=130%>Ottimo lavoro! Altri membri della tribù sono stati liberati dal sigillo dello stregone!"],
12768=>["Value"=>12768,"TextKey"=>"新手引导说明3151","TextValue"=>"Con un numero maggiore di membri nella tua tribù, puoi diradare più <color=#f58c26>Nebbia</color>!"],
12769=>["Value"=>12769,"TextKey"=>"新手引导说明3152","TextValue"=>"<line-height=130%>È necessario un certo livello di Forza tribale per diradare la nebbia in ogni area."],
12770=>["Value"=>12770,"TextKey"=>"新手引导说明3153","TextValue"=>"<line-height=130%>Ora possiamo diradare la nebbia in quest'area!"],
12771=>["Value"=>12771,"TextKey"=>"新手引导说明3161","TextValue"=>"Non puoi ancora diradare questa nebbia."],
12772=>["Value"=>12772,"TextKey"=>"新手引导说明3162","TextValue"=>"<line-height=130%>La tua <color=#f58c26>Forza tribale</color> non è abbastanza alta. Puoi acquistare altri totem nel negozio."],
12773=>["Value"=>12773,"TextKey"=>"新手引导说明3165","TextValue"=>"<line-height=130%>Spendi oro per comprare totem!"],
12774=>["Value"=>12774,"TextKey"=>"新手引导说明3166","TextValue"=>"<line-height=130%>Il prezzo dei totem aumenterà dopo ogni acquisto. Vai a prendere più oro!"],
12775=>["Value"=>12775,"TextKey"=>"新手引导说明2270","TextValue"=>"<line-height=130%>Questo livello ha un <color=#f58c26>Limite di tempo</color>. Devi completare la prova nel tempo limite indicato, o perderai."],
12776=>["Value"=>12776,"TextKey"=>"新手引导说明2271","TextValue"=>"<line-height=130%>Puoi controllare quanto tempo è rimasto qui."],
12777=>["Value"=>12777,"TextKey"=>"新手引导说明2273","TextValue"=>"<line-height=130%>Man mano che il tempo rimasto diminuisce, il colore dei numeri passerà da <color=#46bb83>verde</color> a <color=#eca852>giallo</color> e infine <color=#e04030>rosso</color>."],
12778=>["Value"=>12778,"TextKey"=>"新手引导说明2274","TextValue"=>"<line-height=130%>Per battere il livello più velocemente, puoi controllare il Negozio."],
12779=>["Value"=>12779,"TextKey"=>"新手引导说明2277","TextValue"=>"<line-height=130%>Puoi spendere <color=#38c0a5>Rubini</color> per comprare oggetti chiave direttamente dal negozio."],
12780=>["Value"=>12780,"TextKey"=>"新手引导说明2281","TextValue"=>"<line-height=130%>Questo tipo di livelli ti dà un <color=#38c0a5>Membro della tribù</color> come ricompensa. Puoi spendere <color=#38c0a5>Rubini</color> per raddoppiare le tue ricompense."],
12781=>["Value"=>12781,"TextKey"=>"新手引导说明2290","TextValue"=>"<line-height=130%>Ti diamo il benvenuto a un'altra Prova divina! Una volta superata la sfida, riceverai una ricompensa."],
12782=>["Value"=>12782,"TextKey"=>"新手引导说明2291","TextValue"=>"<line-height=130%>Puoi completare una prova <color=#f58c26>tre volte</color>, ma il tempo limite si accorcia ogni volta."],
12783=>["Value"=>12783,"TextKey"=>"新手引导说明3149","TextValue"=>"<line-height=130%>Per salire di livello dovrai attendere la sessione di addestramento dell'eroe, oppure puoi spendere <color=#38c0a5>Rubini</color> per accelerare il processo."],
12784=>["Value"=>12784,"TextKey"=>"新手引导说明2300","TextValue"=>"<line-height=130%>Guarda, questa è una <color=#46bb83>Nicchia intarsiata</color> e controlla una vasta area di nebbia."],
12785=>["Value"=>12785,"TextKey"=>"新手引导说明2301","TextValue"=>"<line-height=130%>Trascina l'oggetto corrispondente nella nicchia per diradare la nebbia."],
12786=>["Value"=>12786,"TextKey"=>"新手引导说明2302","TextValue"=>"<line-height=130%>Se la nicchia è ancora dormiente, allora prima dovrai svegliarla."],
12787=>["Value"=>12787,"TextKey"=>"新手引导说明2400","TextValue"=>"<line-height=130%>Benvenuti all'Evento! Resterà aperto solo per un periodo di tempo limitato!"],
12788=>["Value"=>12788,"TextKey"=>"新手引导说明2401","TextValue"=>"<line-height=130%>Partecipare a un evento ti dona tantissime di ricompense, che saranno inviate alla tua Terra natia!"],
12789=>["Value"=>12789,"TextKey"=>"新手引导说明2402","TextValue"=>"<line-height=130%>Qui vedrete alcuni oggetti unici, nuove creature e nuove modalità di gioco!"],
12790=>["Value"=>12790,"TextKey"=>"新手引导说明3180","TextValue"=>"<line-height=130%>Le torce sono necessarie per spingerti oltre nei livelli! Si ricaricano con il tempo."],
12791=>["Value"=>12791,"TextKey"=>"新手引导说明3181","TextValue"=>"<line-height=130%>Hai tantissime torce ora! Usale per giocare nei livelli!"],
12792=>["Value"=>12792,"TextKey"=>"新手引导说明1072","TextValue"=>"<line-height=130%>D'ora in poi, puoi controllare le tue <color=#38c0a5>ricompense del Campo</color>!"],
12793=>["Value"=>12793,"TextKey"=>"新手引导说明1073","TextValue"=>"<line-height=130%>Quando sarà il momento, puoi reclamare le tue ricompense!"],
12794=>["Value"=>12794,"TextKey"=>"新手引导说明1074","TextValue"=>"<line-height=130%>Più stelle ottieni nei livelli, maggiori saranno le ricompense!"],
12795=>["Value"=>12795,"TextKey"=>"新手引导说明2235","TextValue"=>"<line-height=130%>Guarda! È proprio là sulla mappa! Sblocca e dai un'occhiata!"],
12796=>["Value"=>12796,"TextKey"=>"新手引导说明2310","TextValue"=>"<line-height=130%>Il nostro esploratore ha trovato uno spiazzo perfetto per creare un nuovo Campo. Vai a dargli un'occhiata!"],
12797=>["Value"=>12797,"TextKey"=>"新手引导说明2315","TextValue"=>"<line-height=130%>Potremmo incontrare qualcuno di davvero interessante qui!"],
12798=>["Value"=>12798,"TextKey"=>"新手引导说明2320","TextValue"=>"<line-height=130%>Benvenuti all'<color=#46bb83>Evento Gita invernale</color>. Un mondo meraviglioso ti aspetta!"],
