12838=>["Value"=>12838,"TextKey"=>"新手引导说明2540","TextValue"=>"Benvenuto nella <color=#f58c26> Case degli eroi</color>. Molti eroi e storie affascinanti sono nascoste qui, aspettano che tu le esplori!"],
