13596=>["Value"=>13596,"TextKey"=>"攻击过程文字1020","TextValue"=>"Muori! Muori!"],
13597=>["Value"=>13597,"TextKey"=>"攻击过程文字1021","TextValue"=>"Prendi il mio pugno!"],
13598=>["Value"=>13598,"TextKey"=>"攻击过程文字1022","TextValue"=>"Sparisci dalla mia vista!"],
13599=>["Value"=>13599,"TextKey"=>"攻击过程文字1023","TextValue"=>"Perisci nella tempesta."],
13600=>["Value"=>13600,"TextKey"=>"攻击过程文字1024","TextValue"=>"Polvere alla polvere."],
13601=>["Value"=>13601,"TextKey"=>"攻击过程文字1025","TextValue"=>"Allontanati dalla mia festa!"],
13602=>["Value"=>13602,"TextKey"=>"攻击过程文字1026","TextValue"=>"Vai via!"],
13603=>["Value"=>13603,"TextKey"=>"攻击过程文字1027","TextValue"=>"Vattene!"],
13604=>["Value"=>13604,"TextKey"=>"攻击过程文字1028","TextValue"=>"Vattene..."],
13605=>["Value"=>13605,"TextKey"=>"攻击过程文字1029","TextValue"=>"Non puoi batterci!"],
13606=>["Value"=>13606,"TextKey"=>"攻击过程文字1030","TextValue"=>"Accetta il tuo destino!"],
13607=>["Value"=>13607,"TextKey"=>"攻击过程文字1031","TextValue"=>"Ah!"],
13608=>["Value"=>13608,"TextKey"=>"攻击过程文字1032","TextValue"=>"Temetemi!"],
13609=>["Value"=>13609,"TextKey"=>"攻击过程文字1033","TextValue"=>"Arrenditi e basta!"],
13610=>["Value"=>13610,"TextKey"=>"攻击过程文字1034","TextValue"=>"Vincere! Vincere!"],
13611=>["Value"=>13611,"TextKey"=>"攻击过程文字1035","TextValue"=>"Perisci nella tempesta."],
13612=>["Value"=>13612,"TextKey"=>"攻击过程文字1036","TextValue"=>"Scompari in un fulmine."],
13613=>["Value"=>13613,"TextKey"=>"攻击过程文字1037","TextValue"=>"Assapora questo colpo in combo!"],
13614=>["Value"=>13614,"TextKey"=>"攻击过程文字1038","TextValue"=>"Vai via!"],
13615=>["Value"=>13615,"TextKey"=>"攻击过程文字1039","TextValue"=>"Devi proteggere la casa..."],
13616=>["Value"=>13616,"TextKey"=>"天气雷名称100001","TextValue"=>"Fulmine"],
13617=>["Value"=>13617,"TextKey"=>"天气雷描述100001","TextValue"=>"Metti un fulmine sopra un oggetto per trascinare insieme gli stessi."],
13618=>["Value"=>13618,"TextKey"=>"剧情ID1010101","TextValue"=>"<line-height=130%>Salve, Capo! Sono Tristan, il tuo esploratore! Sono contento che siamo tutti sopravvissuti a questo viaggio accidentato. Abbiamo finalmente raggiunto la landa, quindi allestiamo un <color=#f58c26>Campo</color>. "],
13619=>["Value"=>13619,"TextKey"=>"剧情ID1010102","TextValue"=>"<line-height=130%>Questo è piuttosto rigoglioso! Non sai cosa potremmo incontrare qui? Cominciamo a puntellare la nostra tenda per proteggerci!"],
13620=>["Value"=>13620,"TextKey"=>"剧情ID1010201","TextValue"=>"<line-height=130%>Oh cielo, guarda questa brutta terra... e questa brutta tenda! Mi manca tanto la mia casa..."],
13621=>["Value"=>13621,"TextKey"=>"剧情ID1010202","TextValue"=>"Ora, Enda, so che lasciare casa è difficile, ma l'unico modo per salvarla era andarsene. Tutti quei disastri più bizzarri... Dobbiamo trovare una risposta! Ecco perché abbiamo pensato di cercare aiuto."],
13622=>["Value"=>13622,"TextKey"=>"剧情ID1010203","TextValue"=>"<line-height=130%> Ma troveremo un modo per tornare, ok? Cominciamo costruendo un <color=#f58c26>Altare</color> per parlare con dio, che ne dici, sacerdote Enda? Il capo ci aiuterà!"],
13623=>["Value"=>13623,"TextKey"=>"剧情ID1020101","TextValue"=>"<line-height=130%>Guarda cosa abbiamo trovato! L'<color=#ef933d>Eredità culturale della Natura</color>! C'è tutto quello che ci serve per l'<color=#f58c26>Altare</color> e abbiamo trovato un modo per liberarci di quei totem! Questo posto è benedetto!"],
13624=>["Value"=>13624,"TextKey"=>"剧情ID1020201","TextValue"=>"<line-height=130%>Immagino che tu non sia completamente inutile, Stan o qualcosa del genere. Anche se è molto più piccolo e insignificante di quello che avevo a casa, sarà sufficiente per ora! Ora vattene!"],
13625=>["Value"=>13625,"TextKey"=>"剧情ID1020202","TextValue"=>"<line-height=130%>Aww, che dolce, guarda com'è felice e il suo modo molto contorto di ringraziare!"],
13626=>["Value"=>13626,"TextKey"=>"剧情ID1020203","TextValue"=>"<line-height=130%> (dopo aver finito una strana danza) Il nostro dio mi ha detto che siamo nel posto giusto e una grande figura verrà ad aiutarci..."],
13627=>["Value"=>13627,"TextKey"=>"剧情ID1020204","TextValue"=>"<line-height=130%>Davvero? Questa è una grande notizia! Quando incontreremo questa grande figura?"],
13628=>["Value"=>13628,"TextKey"=>"剧情ID1020301","TextValue"=>"<line-height=130%> Siete voi i mascalzoni che hanno disturbato il mio sonno? "],
13629=>["Value"=>13629,"TextKey"=>"剧情ID1020302","TextValue"=>"<line-height=130%>...E tu sei?"],
13630=>["Value"=>13630,"TextKey"=>"剧情ID1020303","TextValue"=>"<line-height=130%>Sono l'Arcidruido, padre dei bardi, conquistatore della tempesta, protettore degli avventurieri, il terrificante messaggero divino, esecutore e giudice, il cantore Amergin! "],
13631=>["Value"=>13631,"TextKey"=>"剧情ID1020304","TextValue"=>"<line-height=130%>Ah... Piacere di conoscerti, immagino? Siamo nuovi della zona e abbiamo appena sentito..."],
13632=>["Value"=>13632,"TextKey"=>"剧情ID1020305","TextValue"=>"<line-height=130%>Cosa?! Siete invasori?! Non distruggerete la nostra casa e non dividerete le famiglie! "],
13633=>["Value"=>13633,"TextKey"=>"剧情ID1020401","TextValue"=>"Cosa? No, no! Non siamo invasori, stiamo solo cercando di trovare un posto per riposare, e forse risolvere il mistero della nostra patria..."],
13634=>["Value"=>13634,"TextKey"=>"剧情ID1020402","TextValue"=>"No! Il ponte! Guardate cosa hai fatto! Dio si arrabbierà! Aspetta... Chi hai detto di essere? Amergin? Amergin l'Arcidruido? Quello delle leggende?!"],
13635=>["Value"=>13635,"TextKey"=>"剧情ID1020403","TextValue"=>"Voi... non siete invasori? Chi siete? Perché siete qui? Aspetta.. Perché mi trovo qui, e che cos'è questo posto? Dov'è la mia gente? Non ricordo questa terra..."],
13636=>["Value"=>13636,"TextKey"=>"剧情ID1020404","TextValue"=>"Mi dispiace molto, ma neanche noi abbiamo le risposte. Abbiamo viaggiato molto, abbiamo rischiato la vita per arrivare qui, cercando di trovare degli aiutanti che possano risolvere il mistero della nostra patria. Prima è calata su di noi una fitta nebbia, poi..."],
13637=>["Value"=>13637,"TextKey"=>"剧情ID1020405","TextValue"=>"Abbiamo avuto più inondazioni nell'ultimo anno che nell'ultimo decennio. Ma la cosa più curiosa è che la gente si è trasformata in totem senza vita! Riesci a crederci?!"],
13638=>["Value"=>13638,"TextKey"=>"剧情ID1020406","TextValue"=>"Oh... è... molto da assimilare. Mi dispiace di averti attaccato e distrutto il tuo ponte. Forse posso aiutarvi a ricostruirlo?"],
13639=>["Value"=>13639,"TextKey"=>"剧情ID1020407","TextValue"=>"Amergin?! Il potente Amergin?! La tua veste, il tuo potere di comandare la tempesta... Tu sei reale! Questo significa che quei racconti nel libro della mia famiglia sono veri!"],
13640=>["Value"=>13640,"TextKey"=>"剧情ID1020408","TextValue"=>"<line-height=130%>Lavoratori! Ricomponetevi e ricostruite quel ponte!"],
13641=>["Value"=>13641,"TextKey"=>"剧情ID1020409","TextValue"=>"<line-height=130%>Ma siamo feriti! Non possiamo iniziare a costruire ora! "],
13642=>["Value"=>13642,"TextKey"=>"剧情ID1020410","TextValue"=>"Io so la cosa giusta. Ho imparato la medicina a base di erbe in anni di viaggi. Raccogliamo alcune erbe e coltiviamo un <color=#f58c26>Giardino di erbe</color> qui, come modo per farmi perdonare."],
13643=>["Value"=>13643,"TextKey"=>"剧情ID1020411","TextValue"=>"Grazie! È molto gentile da parte tua. Torneremo anche a casa più tardi per liberare quelli intrappolati nei totem, ora che abbiamo imparato come fare! Bene, andiamo!"],
13644=>["Value"=>13644,"TextKey"=>"剧情ID1030101","TextValue"=>"<line-height=130%>Siamo tornati, e abbiamo portato degli aiutanti da casa! Costruiamo il giardino allora!"],
13645=>["Value"=>13645,"TextKey"=>"剧情ID1030201","TextValue"=>"<line-height=130%>Wow, non posso dire di non essere impressionato, sei davvero bravo. Questo piccolo giardino è bellissimo. "],
13646=>["Value"=>13646,"TextKey"=>"剧情ID1030202","TextValue"=>"<line-height=130%>E anche molto utile. I lavoratori verranno subito curati e saranno presto pronti a ricostruire il ponte!"],
13647=>["Value"=>13647,"TextKey"=>"剧情ID1030203","TextValue"=>"<line-height=130%>Lieto di essere stato d'aiuto."],
13648=>["Value"=>13648,"TextKey"=>"剧情ID1030204","TextValue"=>"A proposito di questo, infatti, questo sacerdote stava giusto parlando di quanto tu sia virtuoso e competente. Quello che sto cercando di dire è..."],
13649=>["Value"=>13649,"TextKey"=>"剧情ID1030205","TextValue"=>"Sarebbe un onore se un avventuriero esperto, e una grande figura come te potesse unirsi a noi. Ma tu sei una leggenda! Non esiste che tu ti unisca a degli strani sconosciuti! Lo farai? Per favore? Ti prego, vieni con noi!!!"],
13650=>["Value"=>13650,"TextKey"=>"剧情ID1030206","TextValue"=>"<line-height=130%>Certo, forse è proprio per questo che sono stato mandato qui."],
13651=>["Value"=>13651,"TextKey"=>"剧情ID1030207","TextValue"=>"<line-height=130%>Lo sapevo. Non lo farai... COSA?! Vieni con noi?! Oh, non posso crederci... Il miglior giorno della mia VITA! "],
13652=>["Value"=>13652,"TextKey"=>"剧情ID1030208","TextValue"=>"Scusa, a volte si emoziona troppo. Quindi, ora che vieni con noi, che ne dici se organizziamo una festa di benvenuto per te?"],
13653=>["Value"=>13653,"TextKey"=>"剧情ID1030209","TextValue"=>"No, sto bene senza una festa, ho questioni più urgenti di cui occuparmi. Vado a cercare del legno per ricostruire il ponte che ho rotto."],
13654=>["Value"=>13654,"TextKey"=>"剧情ID1030210","TextValue"=>"<line-height=130%>Che uomo onorevole! Oh! Solo per per averlo incontrato... Il giorno più bello della mia vita!"],
13655=>["Value"=>13655,"TextKey"=>"剧情ID1040101","TextValue"=>"<line-height=130%>Tu sei il Capo... giusto? Grazie per il tuo aiuto laggiù. Ora siamo pronti a ricostruire quel ponte."],
13656=>["Value"=>13656,"TextKey"=>"剧情ID1040201","TextValue"=>"<line-height=130%>Come nuovo! Ora, sei contento di andare a parlare di nuovo con il tuo dio, sacerdote Enda?"],
13657=>["Value"=>13657,"TextKey"=>"剧情ID1040202","TextValue"=>"<line-height=130%>Mai stato più pronto! "],
13658=>["Value"=>13658,"TextKey"=>"剧情ID1040301","TextValue"=>"<line-height=130%>Ok, Capo, mentre il sacerdote si gode il suo ricongiungimento con il suo amato altare, noi possiamo metterci al lavoro..."],
13659=>["Value"=>13659,"TextKey"=>"剧情ID1040401","TextValue"=>"Ahi, cosa mi ha fatto inciampare? Huh, vedo, un pezzo di <color=#38c0a5>Minerale selvaggio</color> dall'<color=#f58c26>Altare</color>. Siete terribilmente sbadati quando lavorate."],
13660=>["Value"=>13660,"TextKey"=>"剧情ID1040402","TextValue"=>"<line-height=130%>Ahah, lo so! Dobbiamo costruire un <color=#f58c26>Magazzino</color> per conservare le risorse, in modo che la gente non inciampi nei materiali sparsi ovunque."],
13661=>["Value"=>13661,"TextKey"=>"剧情ID1050101","TextValue"=>"<line-height=130%>Hai tutto quello che ci serve? Allora diamo inizio alla festa! Scusa, intendevo il <color=#f58c26>Magazzino</color>."],
13662=>["Value"=>13662,"TextKey"=>"剧情ID1050201","TextValue"=>"<line-height=130%>Muro solido, spazio bello e grande... Grande abilità di costruzione, Capo!"],
13663=>["Value"=>13663,"TextKey"=>"剧情ID1050202","TextValue"=>"<line-height=130%>Ah... Signore? C'è un coso a otto zampe proprio dietro di te."],
13664=>["Value"=>13664,"TextKey"=>"剧情ID1050301","TextValue"=>"Cosa?! Come?! Cos'è questo?! Sembra il corpo di una specie di creatura acquatica...hmm, e la pelle è viscida ed elastica!"],
13665=>["Value"=>13665,"TextKey"=>"剧情ID1050302","TextValue"=>"<line-height=130%><color=#f58c26>Kraken</color>! È un <color=#f58c26>Kraken</color>! Ho letto di loro nei miei libri! Deve essere un cucciolo di quel mostro! Perché c'è un <color=#f58c26>Kraken</color>?!"],
13666=>["Value"=>13666,"TextKey"=>"剧情ID1050303","TextValue"=>"Non c'è bisogno di farsi prendere dal panico. Per prima cosa è sicuramente morto, e poi questo è solo un comune <color=#f58c26>Polipo</color>."],
13667=>["Value"=>13667,"TextKey"=>"剧情ID1050304","TextValue"=>"<line-height=130%>Polipo? Mai sentito parlare di loro..."],
13668=>["Value"=>13668,"TextKey"=>"剧情ID1050305","TextValue"=>"Questo significa che provenite dall’entroterra. La mia gente è nomade. Noi dipendiamo dal mare. I polpi per noi sono comuni come le stelle nel cielo notturno."],
13669=>["Value"=>13669,"TextKey"=>"剧情ID1050306","TextValue"=>"In realtà, vieni con me a trovare delle corde e dei rami. Ti mostrerò come costruire una tenda con la pelle di un polipo."],
13670=>["Value"=>13670,"TextKey"=>"剧情ID1060101","TextValue"=>"<line-height=130%>...e questo è... fatto. Era molto meglio nella mia immaginazione."],
13671=>["Value"=>13671,"TextKey"=>"剧情ID1060102","TextValue"=>"<line-height=130%>È...uh......uh......adorabile!"],
13672=>["Value"=>13672,"TextKey"=>"剧情ID1060103","TextValue"=>"Mi dispiace. Sono più una persona di teoria che di pratica. La costruzione non è il mio forte. Ora... potrei aver bisogno di sdraiarmi..."],
13673=>["Value"=>13673,"TextKey"=>"剧情ID1060104","TextValue"=>"Oh grande Amergin! Perché non vai a riposare nella tenda principale, e io ti farò compagnia! Mi hai impartito la tua saggezza, e io sarò per sempre al tuo servizio."],
13674=>["Value"=>13674,"TextKey"=>"剧情ID1060201","TextValue"=>"Questo deve essere un sogno che si avvera per un sacerdote. Sono contento di vedere quei due andare d'accordo. Tuttavia, è tutto un po' strano, non credi, capo?"],
13675=>["Value"=>13675,"TextKey"=>"剧情ID1060202","TextValue"=>"Gli anziani hanno detto che quelli che hanno viaggiato verso il mare non sono mai tornati, tranne quello che è tornato come un pazzo, parlando di una barriera gigante fatta di acqua ai confini del mondo."],
13676=>["Value"=>13676,"TextKey"=>"剧情ID1060203","TextValue"=>"<line-height=130%>Eppure quell'Amergin diceva che sono gente di mare! Nessun popolo vive sul mare!"],
13677=>["Value"=>13677,"TextKey"=>"剧情ID1060204","TextValue"=>"<line-height=130%>Ecco perché è curioso. Ma comunque, non ci ha fatto alcun male. Atteniamoci al nostro lavoro per ora. "],
13678=>["Value"=>13678,"TextKey"=>"剧情ID1060205","TextValue"=>"<line-height=130%>Ora che avete esplorato in giro, la quantità di trofei che abbiamo trovato è incredibile. Alcuni animali potrebbero aiutare a portarli a casa. E per il loro comfort, dovremmo costruire una <color=#f58c26>Capanna per il bestiame</color>."],
13679=>["Value"=>13679,"TextKey"=>"剧情ID1070101","TextValue"=>"<line-height=130%>Si sta bene, capo! Sembra che questi piccoletti ci torneranno subito utili, fantastico!"],
13680=>["Value"=>13680,"TextKey"=>"剧情ID1070102","TextValue"=>"<line-height=130%>Abbiamo quasi finito con le costruzioni, anche se c'è un'ultima cosa per cui ho bisogno del tuo aiuto."],
13681=>["Value"=>13681,"TextKey"=>"剧情ID1070103","TextValue"=>"<line-height=130%>Nel caso in cui qualche malintenzionato venga a rovinare il nostro campo una volta che ce ne siamo andati, abbiamo bisogno di una squadra di esploratori professionisti per pattugliare la zona e proteggere il nostro lavoro."],
13682=>["Value"=>13682,"TextKey"=>"剧情ID1070104","TextValue"=>"<line-height=130%>Abbiamo bisogno di un <color=#f58c26>anello di addestramento</color>!"],
13683=>["Value"=>13683,"TextKey"=>"剧情ID1070105","TextValue"=>"<line-height=130%>Ecco Kevin, un <color=#f58c26>anello di addestramento</color>. Andiamo a cercare del materiale!"],
13684=>["Value"=>13684,"TextKey"=>"剧情ID1080101","TextValue"=>"<line-height=130%>Sei pronto?"],
13685=>["Value"=>13685,"TextKey"=>"剧情ID1080102","TextValue"=>"<line-height=130%>Sissignore!"],
13686=>["Value"=>13686,"TextKey"=>"剧情ID1080103","TextValue"=>"<line-height=130%>Il capo ha finito di preparare i materiali, allora cominciamo!"],
13687=>["Value"=>13687,"TextKey"=>"剧情ID1080104","TextValue"=>"<line-height=130%>Sissignore! Nessun problema signore!"],
13688=>["Value"=>13688,"TextKey"=>"剧情ID1080201","TextValue"=>"<line-height=130%>Ottimo lavoro! E ora... Sacerdote? Cosa c'è che non va?"],
13689=>["Value"=>13689,"TextKey"=>"剧情ID1080301","TextValue"=>"Stavo parlando con il suo Arcidruido Amergin, poi ci siamo addormentati per la stanchezza, ed entrambi abbiamo fatto questo strano sogno in cui una dea ci diceva "Salva il <color=#f58c26>Cuore del mare</color>...""],
13690=>["Value"=>13690,"TextKey"=>"剧情ID1080302","TextValue"=>"<line-height=130%><color=#f58c26>Cuore del mare</color>? Che cos'è?"],
13691=>["Value"=>13691,"TextKey"=>"剧情ID1080303","TextValue"=>"Abbiamo un vecchio racconto che parla di una bolla gigante nel mare, protetta dalla più giovane delle dee. In essa, non solo sono sopravvissuti gli animali antichi, ma giganti e fate ci vivono ancora. Ma è semplicemente una fiaba della buonanotte"],
13692=>["Value"=>13692,"TextKey"=>"剧情ID1080304","TextValue"=>"<line-height=130%>Devo andare in fondo a questa storia. Per ottenere un messaggio più chiaro dalla dea avrò bisogno di una <color=#f58c26>Base runica potente</color>."],
13693=>["Value"=>13693,"TextKey"=>"剧情ID1080305","TextValue"=>"<line-height=130%>Ricevuto. Ok, Capo, andiamo a prendere dei minerali selvaggi e costruiamo la base per Enda."],
13694=>["Value"=>13694,"TextKey"=>"剧情ID1090101","TextValue"=>"<line-height=130%>Abbiamo quasi finito! Dobbiamo festeggiare!"],
13695=>["Value"=>13695,"TextKey"=>"剧情ID1090102","TextValue"=>"<line-height=130%>Evviva!"],
13696=>["Value"=>13696,"TextKey"=>"剧情ID1090201","TextValue"=>"<line-height=130%>Non è ancora tempo per fare festa! Non riesco a concentrarmi se siete così chiassosi!"],
13697=>["Value"=>13697,"TextKey"=>"剧情ID1090202","TextValue"=>"<line-height=130%>Stavo cercando di riconnettermi con una divinità ma il momento è stato rovinato da voi idioti sguaiati!"],
13698=>["Value"=>13698,"TextKey"=>"剧情ID1090203","TextValue"=>"<line-height=130%>Smettete di parlare e lasciatemi in pace!"],
13699=>["Value"=>13699,"TextKey"=>"剧情ID1090204","TextValue"=>"<line-height=130%>Ouch, sembra che qualcuno non stia avendo una bella giornata."],
13700=>["Value"=>13700,"TextKey"=>"剧情ID1090205","TextValue"=>"<line-height=130%>Aspettate! Zitti! Credo di sentirla. Questo è molto importante."],
13701=>["Value"=>13701,"TextKey"=>"剧情ID1090206","TextValue"=>"Mmmh... Non riesco a sentire molto chiaramente... Ma credo che... dovremmo dirigerci a nord, dove nulla può crescere, e nulla può vivere. Lì troveremo un amico."],
13702=>["Value"=>13702,"TextKey"=>"剧情ID1090207","TextValue"=>"<line-height=130%>Okay, sembra... fattibile? Voglio dire, cosa può andare storto! E nord sia! "],
13703=>["Value"=>13703,"TextKey"=>"剧情ID1090208","TextValue"=>"Ma prima di questo, è finalmente il momento di festeggiare il nostro nuovo Campo! Radunatevi, perché stiamo per fare una grande festa!"],
13704=>["Value"=>13704,"TextKey"=>"剧情ID1090209","TextValue"=>"<line-height=130%>Urrà!"],
13705=>["Value"=>13705,"TextKey"=>"剧情ID1090301","TextValue"=>"Siamo partiti da casa pensando che non saremmo mai più tornati, eppure abbiamo trovato quest'isola incredibile, abbiamo incontrato nuovi amici e abbiamo persino trovato il modo di far rivivere membri della tribù che pensavamo fossero persi per sempre."],
13706=>["Value"=>13706,"TextKey"=>"剧情ID1090302","TextValue"=>"Per tutto questo, dobbiamo ringraziare la nostra dea, che si è presa cura di noi e ci ha guidato, il nostro nuovo amico, il caro Amergin, che ci ha disinteressatamente prestato la sua incredibile conoscenza."],
13707=>["Value"=>13707,"TextKey"=>"剧情ID1090303","TextValue"=>"Ma soprattutto, Capo, non avremmo potuto realizzare nulla di tutto questo se tu non fossi stato forte e gentile. Quindi grazie Capo, per tutto quello che hai fatto per noi, e... uh... Sacerdote, stai piangendo?"],
13708=>["Value"=>13708,"TextKey"=>"剧情ID1090304","TextValue"=>"Io... non sto... *sniff* piangendo... È solo... *sniff* Ok, sto piangendo! Sto piangendo! Ora siete tutti soddisfatti?! Ti voglio bene, Capo! Sei il migliore, Capo!! "],
13709=>["Value"=>13709,"TextKey"=>"剧情ID1090305","TextValue"=>"Ahahah, credo che questo dica tutto, Capo. Non vedo l'ora di scoprire come sarà il nostro viaggio in futuro. E un giorno sicuramente risolveremo il mistero della nostra casa, e la ricostruiremo."],
13710=>["Value"=>13710,"TextKey"=>"剧情ID2010101","TextValue"=>"<line-height=130%>Non abbiate fretta ragazzi, ci siamo quasi..."],
13711=>["Value"=>13711,"TextKey"=>"剧情ID2010102","TextValue"=>"<line-height=130%>Meno male! Sono giorni che camminiamo nel deserto. Forse puoi darmi un po' d'acqua? "],
13712=>["Value"=>13712,"TextKey"=>"剧情ID2010103","TextValue"=>"<line-height=130%>Un po' di pazienza! Quando avevo la tua età... Ehi, cos'è questo?"],
13713=>["Value"=>13713,"TextKey"=>"剧情ID2010201","TextValue"=>"<line-height=130%>WOAAAAAAAAH!"],
13714=>["Value"=>13714,"TextKey"=>"剧情ID2010202","TextValue"=>"<line-height=130%>Sacerdote?!"],
13715=>["Value"=>13715,"TextKey"=>"剧情ID2010203","TextValue"=>"<line-height=130%>Oh no, sei laggiù? Stai bene?"],
13716=>["Value"=>13716,"TextKey"=>"剧情ID2010204","TextValue"=>"<line-height=130%>Bene... Sono ancora vivo... Mmmh, credo di essere stato trascinato giù da questa... miniera magica?"],
13717=>["Value"=>13717,"TextKey"=>"剧情ID2010205","TextValue"=>"<line-height=130%>Per fortuna stai bene. Non preoccuparti, faremo tutto il possibile per tirarti fuori di lì il prima possibile."],
13718=>["Value"=>13718,"TextKey"=>"剧情ID2010301","TextValue"=>"<line-height=130%>Capo, ho trovato un edificio abbandonato su una collina vicina. Ho visto una grande macchina per corde di paglia all'interno, ma è circondata da un caos terribile."],
13719=>["Value"=>13719,"TextKey"=>"剧情ID2010302","TextValue"=>"<line-height=130%>Immagino che sia una <color=#f58c26>Vecchia bottega</color> di qualche tipo."],
13720=>["Value"=>13720,"TextKey"=>"剧情ID2010303","TextValue"=>"<line-height=130%>Possiamo cercare di aprire la porta e ripulirla in modo da poter creare una carrucola di corda e tirare fuori il sacerdote."],
13721=>["Value"=>13721,"TextKey"=>"剧情ID2010304","TextValue"=>"<line-height=130%>Bene, smettila di chiacchierare e vai a creare quella carrucola!"],
13722=>["Value"=>13722,"TextKey"=>"剧情ID2010305","TextValue"=>"Calmati sacerdote! Il cielo si sta facendo scuro, presto si congelerà qui fuori! Dobbiamo prima trovare i materiali per costruire una <color=#f58c26>Tenda</color> e cercare una soluzione una volta che saremo tutti più riposati."],
13723=>["Value"=>13723,"TextKey"=>"剧情ID2010306","TextValue"=>"<line-height=130%>Ma io? Potrei morire di freddo!"],
13724=>["Value"=>13724,"TextKey"=>"剧情ID2010307","TextValue"=>"<line-height=130%>Non ti preoccupare. Anche se in superficie lo sbalzo termico tra il giorno e la notte è enorme, la temperatura del sottosuolo è sempre costante e piacevole. Tieni duro, sacerdote! "],
13725=>["Value"=>13725,"TextKey"=>"剧情ID2020101","TextValue"=>"Il giorno dopo......"],
13726=>["Value"=>13726,"TextKey"=>"剧情ID2020201","TextValue"=>"<line-height=130%>È stata una bella dormita! Come va laggiù, sacerdote?"],
13727=>["Value"=>13727,"TextKey"=>"剧情ID2020202","TextValue"=>"<line-height=130%>Apprezzerei se spendessi le tue energie per portarmi fuori di qui invece di chiedermi come sto!"],
13728=>["Value"=>13728,"TextKey"=>"剧情ID2020203","TextValue"=>"<line-height=130%>Ci stiamo lavorando, ho solo bisogno di alcuni strumenti necessari per aprire quella porta prima di procedere. mantieni la calma. *Sorride*"],
13729=>["Value"=>13729,"TextKey"=>"剧情ID2020204","TextValue"=>"<line-height=130%>Aspetta solo che mi rialzi... Piccolo monello irrispettoso e ingrato..."],
13730=>["Value"=>13730,"TextKey"=>"剧情ID2020205","TextValue"=>"<line-height=130%>Ahi, i miei sentimenti sono molto feriti! Come hai potuto fraintendere così il mio buon cuore? Ma ti perdono. Io e il Capo torniamo subito!"],
13731=>["Value"=>13731,"TextKey"=>"剧情ID2030201","TextValue"=>"Ok, siamo dentro! Ora abbiamo solo bisogno di..."],
13732=>["Value"=>13732,"TextKey"=>"剧情ID2030202","TextValue"=>"Signore, attenzione! Dietro di te!"],
13733=>["Value"=>13733,"TextKey"=>"剧情ID2030203","TextValue"=>"Ahi! Da dove viene questa freccia?!"],
13734=>["Value"=>13734,"TextKey"=>"剧情ID2030204","TextValue"=>"Uscite dall'edificio!"],
13735=>["Value"=>13735,"TextKey"=>"剧情ID2030205","TextValue"=>"Chi va là?"],
13736=>["Value"=>13736,"TextKey"=>"剧情ID2030206","TextValue"=>"Esci! Rapitore!"],
13737=>["Value"=>13737,"TextKey"=>"剧情ID2030207","TextValue"=>"Ladro? Credo che abbia sbagliato persona, signora della voce... Ahi, ahi, ahi!"],
13738=>["Value"=>13738,"TextKey"=>"剧情ID2030301","TextValue"=>"Signora della voce, siamo fuori dall'edificio, ora vuole spiegarmi cosa sta succedendo?"],
13739=>["Value"=>13739,"TextKey"=>"剧情ID2030302","TextValue"=>"Prima di tutto, il mio nome non è Signora della voce; sono Tlachtga, cacciatrice di fulmini, figlia di Mug Ruith, madre di tutte le lande, eroina per..."],
13740=>["Value"=>13740,"TextKey"=>"剧情ID2030303","TextValue"=>"<size=100%>Grande Tlachtga!!!!!!!!!!!"],
13741=>["Value"=>13741,"TextKey"=>"剧情ID2030304","TextValue"=>"Cosa... Da dove viene questa voce... Dai piedi della collina? Qualcuno è caduto in quella miniera?"],
13742=>["Value"=>13742,"TextKey"=>"剧情ID2030305","TextValue"=>"Voi tre, rimanete perfettamente immobili fino al mio ritorno. Se scopro che vi siete mossi di un solo centimetro, sapete cosa vi attende."],
13743=>["Value"=>13743,"TextKey"=>"剧情ID2030306","TextValue"=>"Sì, signora, neanche un centimetro!"],
13744=>["Value"=>13744,"TextKey"=>"剧情ID2030401","TextValue"=>"Eccoti qua. Un sacerdote? Cosa ci fai laggiù? Ho aperto l'ingresso di questa miniera mentre cercavo qualcuno, come mai ci sei tu?"],
13745=>["Value"=>13745,"TextKey"=>"剧情ID2030402","TextValue"=>"Per farla breve, ero con i tre ragazzi che avevate preso laggiù, solo che io sono caduto in questa miniera. Ma che importa? Sei qui! Avevo predetto che avremmo incontrato un amico che ci avrebbe aiutato su questa landa arida. Ancora non ci credo che sia tu!"],
13746=>["Value"=>13746,"TextKey"=>"剧情ID2030403","TextValue"=>"<line-height=130%>Amico? Aiutarti? Per cosa? Non siete... rapitori?"],
13747=>["Value"=>13747,"TextKey"=>"剧情ID2030404","TextValue"=>"<line-height=130%>Rapitori? No no no, siamo solo dei passanti, in missione per salvare la nostra casa! *Spiega*"],
13748=>["Value"=>13748,"TextKey"=>"剧情ID2030405","TextValue"=>"Uh. Ora che ci penso, la mamma ha detto di aver incontrato un gruppo di persone come voi... Ma poi è scomparsa... Quindi significa che ho preso le persone sbagliate."],
13749=>["Value"=>13749,"TextKey"=>"剧情ID2030406","TextValue"=>"<line-height=130%>Mamma?"],
13750=>["Value"=>13750,"TextKey"=>"剧情ID2030407","TextValue"=>"Lascia perdere, non è un grosso problema. Immagino che i tuoi ragazzi siano finiti in quella mia trappola per far partire la macchina delle corde, in modo da poterti tirare fuori."],
13751=>["Value"=>13751,"TextKey"=>"剧情ID2030408","TextValue"=>"<line-height=130%>Sì, saggia signora, è esattamente per questo, e come sono finito così."],
13752=>["Value"=>13752,"TextKey"=>"剧情ID2030409","TextValue"=>"Oh caro, colpa mia, ti aiuterò con la tua ferita più tardi. Per ora, lasciate che tolga le mie trappole e sistemi quella macchina per voi..."],
13753=>["Value"=>13753,"TextKey"=>"剧情ID2030501","TextValue"=>"<line-height=130%>La macchina delle corde di paglia è pronta e funzionante, ottimo lavoro, signora!"],
13754=>["Value"=>13754,"TextKey"=>"剧情ID2030592","TextValue"=>"<line-height=130%>Non va bene per niente! Tiratemi su! Subito, immediatamente!"],
13755=>["Value"=>13755,"TextKey"=>"剧情ID2030683","TextValue"=>"<line-height=130%>Resta solo un passaggio. Dobbiamo solo preparare la corda di paglia e la carrucola prima di poterti ripescare."],
13756=>["Value"=>13756,"TextKey"=>"剧情ID2030774","TextValue"=>"<line-height=130%>Ce l'hai con me...*lacrime*"],
13757=>["Value"=>13757,"TextKey"=>"剧情ID2040101","TextValue"=>"<line-height=130%>Mio Capo, hai già finito di raccogliere i materiali? Fai pure con calma, Enda non è qui, possiamo finalmente avere un po' di pace..."],
13758=>["Value"=>13758,"TextKey"=>"剧情ID2040102","TextValue"=>"<line-height=130%>Ti sento ancora! Non va bene!"],
13759=>["Value"=>13759,"TextKey"=>"剧情ID2040103","TextValue"=>"<line-height=130%>Woops! Non pensavo ci sentisse... Ahah, la carrucola è pronta!"],
13760=>["Value"=>13760,"TextKey"=>"剧情ID2040201","TextValue"=>"<line-height=130%>Caro sacerdote, la squadra di soccorso si sta calando. Per favore, fatti vedere così non pestiamo..."],
13761=>["Value"=>13761,"TextKey"=>"剧情ID2040202","TextValue"=>"<line-height=130%>Mi stai calpestando! Togliti di dosso! "],
13762=>["Value"=>13762,"TextKey"=>"剧情ID2040203","TextValue"=>"<line-height=130%>Sembra che il sacerdote tornerà su molto presto. Grazie mille, signora."],
13763=>["Value"=>13763,"TextKey"=>"剧情ID2040204","TextValue"=>"<line-height=130%>Non darmi della signora, mi chiamo Tlachtga. Ora, fammi vedere, dove ti ho preso poco fa?"],
13764=>["Value"=>13764,"TextKey"=>"剧情ID2040205","TextValue"=>"<line-height=130%>Mi ha preso sullo stinco, signora, no, Tlachtga."],
13765=>["Value"=>13765,"TextKey"=>"剧情ID2040206","TextValue"=>"<line-height=130%>Preso. I cacciatori come me sono professionisti nel curare le ferite. Ho un sacchetto di Foglie di piante grasse giù nella miniera. La usavo come deposito. Coltiviamone un po' e strofiniamo il succo sulla tua bella gambetta!"],
13766=>["Value"=>13766,"TextKey"=>"剧情ID2040207","TextValue"=>"<line-height=130%>Uh... Gambetta... Ok. Quindi dovremmo andare laggiù adesso? "],
13767=>["Value"=>13767,"TextKey"=>"剧情ID2040208","TextValue"=>"No no no, voi piccoli deboli avrete bisogno di torce per vedere laggiù. È molto più profondo di quanto pensiate. Andate a cercare delle torce e degli strumenti per scavare!"],
13768=>["Value"=>13768,"TextKey"=>"剧情ID2050101","TextValue"=>"<line-height=130%>Tieni questo, se il fuoco si spegne, fermati e torna indietro, ok?"],
13769=>["Value"=>13769,"TextKey"=>"剧情ID2050102","TextValue"=>"<line-height=130%>Pronto? Andiamo! Attenti a dove mettete i piedi!"],
13770=>["Value"=>13770,"TextKey"=>"剧情ID2050103","TextValue"=>"<line-height=130%>Sì, signora!"],
13771=>["Value"=>13771,"TextKey"=>"剧情ID2050104","TextValue"=>"Capo, grazie per essere rimasto quassù con me e il sacerdote. Mi rattrista non poter andare, ma Tlachtga ha detto che è meglio che rimanga quassù se non voglio perdere la gamba. Non vedo l'ora di scoprire cosa ci porteranno!"],
13772=>["Value"=>13772,"TextKey"=>"剧情ID2050105","TextValue"=>"<line-height=130%>Non posso credere che la Grande Tlachtga ti abbia permesso di chiamarla per nome. Che onore! E tu non mostri neanche un po' di gratitudine..."],
13773=>["Value"=>13773,"TextKey"=>"剧情ID2050201","TextValue"=>"<line-height=130%>Oh cielo, cos'è quello?"],
13774=>["Value"=>13774,"TextKey"=>"剧情ID2050202","TextValue"=>"<line-height=130%>È un fiume sotterraneo! Incredibile, la nostra squadra ha trovato un <color=#f58c26>Fiume sotterraneo</color>! Ora abbiamo l'acqua!"],
13775=>["Value"=>13775,"TextKey"=>"剧情ID2050203","TextValue"=>"<line-height=130%>E inzuppato."],
13776=>["Value"=>13776,"TextKey"=>"剧情ID2050204","TextValue"=>"<line-height=130%>Beh, datti un contegno, fifone! È solo un po' d'acqua! "],
13777=>["Value"=>13777,"TextKey"=>"剧情ID2050205","TextValue"=>"Ehi tu, Capo, ora che hai l'acqua, possiamo far crescere delle piante grasse! Una foglia di pianta grassa in aggiunta a qualche canto e alle cure adeguate, e otterrai una pianta grassa bella paffuta in men che non si dica!"],
13778=>["Value"=>13778,"TextKey"=>"剧情ID2050206","TextValue"=>"<line-height=130%>Queste signore sono tutte tue, mandale a cercare dei secchi, delle pale e del fertilizzante. Io aspetterò qui."],
13779=>["Value"=>13779,"TextKey"=>"剧情ID2060101","TextValue"=>"<line-height=130%>Va bene! Fatto, guarda com'è carino! Prendine un pezzo, uno grande."],
13780=>["Value"=>13780,"TextKey"=>"剧情ID2060102","TextValue"=>"<line-height=130%>Non ho mai visto questo tipo di pianta prima... Cosa? Prenderne un pezzo hai detto?"],
13781=>["Value"=>13781,"TextKey"=>"剧情ID2060103","TextValue"=>"<line-height=130%>Sì, prendi una foglia, spremi il suo succo, e strofinalo dove hai la ferita."],
13782=>["Value"=>13782,"TextKey"=>"剧情ID2060104","TextValue"=>"<line-height=130%>Okay... Prendi un pezzo... Strofina... Wow, ha funzionato davvero! Non ho mai sentito parlare di erbe che possono guarire le ferite così velocemente!"],
13783=>["Value"=>13783,"TextKey"=>"剧情ID2060105","TextValue"=>"La gente mi chiama madre di tutte le lande, tanto per dire. Suppongo che il nome derivi dal mio strabiliante pollice verde. Queste non sono piante grasse qualsiasi. Le ho allevate io stessa."],
13784=>["Value"=>13784,"TextKey"=>"剧情ID2060106","TextValue"=>"<line-height=130%>Ma tu fai miracoli! Ah! Ora sento che possiamo risolvere il mistero della nostra casa in men che non si dica! "],
13785=>["Value"=>13785,"TextKey"=>"剧情ID2060107","TextValue"=>"A proposito, ho davvero bisogno di fare un pisolino ora che le mie energie sono esaurite. Ti dispiace se mi accomodo in quella tua "casa"? È un campo base? Ce l'hai un letto?"],
13786=>["Value"=>13786,"TextKey"=>"剧情ID2060108","TextValue"=>"Sì, è una specie di Campo Base, e questa è la mappa che abbiamo fatto per tornare indietro. Ma... Hai intenzione di restare solo a dormire o ti unisci a noi?"],
13787=>["Value"=>13787,"TextKey"=>"剧情ID2060109","TextValue"=>"<line-height=130%>Certo che mi unisco a voi! Che domande!! Tu hai bisogno di aiuto e io non sto facendo nulla, quindi perché no? Probabilmente stiamo cercando la stessa persona. Allora, prendo quella mappa. Ci vediamo!"],
13788=>["Value"=>13788,"TextKey"=>"剧情ID2060201","TextValue"=>"E se ne va. Ho la sensazione che sarà una grande amica della nostra gente. Allora finiamo di costruire il nostro campo. E proprio come in quello che avevamo prima, ci servirà un <color=#f58c26>Magazzino</color> per conservare i materiali."],
13789=>["Value"=>13789,"TextKey"=>"剧情ID2060202","TextValue"=>"<line-height=130%>Andiamo a raccogliere dei materiali per il <color=#f58c26>Magazzino</color>!"],
13790=>["Value"=>13790,"TextKey"=>"剧情ID2070101","TextValue"=>"<line-height=130%>Ottimo lavoro! "],
13791=>["Value"=>13791,"TextKey"=>"剧情ID2070102","TextValue"=>"<line-height=130%>Non mi hai ancora ringraziato per averti portato all'acqua! Te l'avevo detto che avevo ragione su questo posto!"],
13792=>["Value"=>13792,"TextKey"=>"剧情ID2070103","TextValue"=>"<line-height=130%>Va bene, va bene. Rispetterò pienamente la tua divinazione in futuro e soddisferò ogni tua irragionevole richiesta. Ora di cosa hai bisogno ancora?"],
13793=>["Value"=>13793,"TextKey"=>"剧情ID2070104","TextValue"=>"<line-height=130%>Tu...! Non importa. Ho bisogno di parlare di nuovo con dio per sapere quale sarà la nostra nuova tappa. Questa volta ho bisogno di una <color=#f58c26>Torre di guardia</color> per provare l'Astrologia. "],
13794=>["Value"=>13794,"TextKey"=>"剧情ID2070105","TextValue"=>"<line-height=130%>Perché l'astrologia? Non siamo nemmeno sicuri di cosa siano quelle stelle, voglio dire, sono solo punti luminosi nel cielo!"],
13795=>["Value"=>13795,"TextKey"=>"剧情ID2070106","TextValue"=>"<line-height=130%>Non abbiamo più tempo! Abbiamo un sacco di lavoro da fare! Smettila con le tue stupidaggini!"],
13796=>["Value"=>13796,"TextKey"=>"剧情ID2070107","TextValue"=>"<line-height=130%>Andate a raccogliere quello che ci serve e tornate il prima possibile!"],
13797=>["Value"=>13797,"TextKey"=>"剧情ID2070108","TextValue"=>"<line-height=130%>Va bene allora..."],
13798=>["Value"=>13798,"TextKey"=>"剧情ID2070201","TextValue"=>"<line-height=130%>Gli adulti me l'avevano detto di non scherzare con gli anziani, e io non li ho mai ascoltati..."],
13799=>["Value"=>13799,"TextKey"=>"剧情ID2080101","TextValue"=>"<line-height=130%>Ok Capo, hai finito il lavoro. Manca solo la <color=#f58c26>Torre di guardia</color> che il sacerdote mi ha chiesto di costruire..."],
13800=>["Value"=>13800,"TextKey"=>"剧情ID2080102","TextValue"=>"<line-height=130%>Ti sento, teppista! Smettila di lamentarti e lavora!"],
13801=>["Value"=>13801,"TextKey"=>"剧情ID2080103","TextValue"=>"<line-height=130%>Ok~ok~*Sigh*"],
13802=>["Value"=>13802,"TextKey"=>"剧情ID2080201","TextValue"=>"<line-height=130%>Ok Capo, vado a parlare con gli dèi."],
13803=>["Value"=>13803,"TextKey"=>"剧情ID2080202","TextValue"=>"<line-height=130%>Puoi rilassarti per un secondo, ci vediamo tra poco."],
13804=>["Value"=>13804,"TextKey"=>"剧情ID2080203","TextValue"=>"<line-height=130%>*Sussurri* Qui, Capo, qui..."],
13805=>["Value"=>13805,"TextKey"=>"剧情ID2080204","TextValue"=>"<line-height=130%>Enda può finalmente fermarsi un attimo."],
13806=>["Value"=>13806,"TextKey"=>"剧情ID2080205","TextValue"=>"<line-height=130%>La nostra squadra ha trovato un mucchio di minerali d'oro e d'argento giù nella miniera."],
13807=>["Value"=>13807,"TextKey"=>"剧情ID2080206","TextValue"=>"<line-height=130%>Stiamo pensando di costruire una cassa per trasportarli quassù e ci farebbe comodo il tuo aiuto."],
13808=>["Value"=>13808,"TextKey"=>"剧情ID2080207","TextValue"=>"<line-height=130%>Ti dispiace raccogliere un po' di materiale per costruire la cassa?"],
13809=>["Value"=>13809,"TextKey"=>"剧情ID2090101","TextValue"=>"<line-height=130%>Uff, quello era un sacco di oro. "],
13810=>["Value"=>13810,"TextKey"=>"剧情ID2090102","TextValue"=>"<line-height=130%>Che cos'è questo? Brilla..."],
13811=>["Value"=>13811,"TextKey"=>"剧情ID2090201","TextValue"=>"<line-height=130%>È un piccolo pacchetto... dice "mangiami". E dentro c'è un <color=#f58c26>Seme luminescente</color>? Significa, tipo, mangiare il seme?"],
13812=>["Value"=>13812,"TextKey"=>"剧情ID2090202","TextValue"=>"<line-height=130%>Lascia fare a me!"],
13813=>["Value"=>13813,"TextKey"=>"剧情ID2090203","TextValue"=>"<line-height=130%>Cosa?! sacerdote, cosa stai facendo?!"],
13814=>["Value"=>13814,"TextKey"=>"剧情ID2090301","TextValue"=>"<line-height=130%>Non l'avrai mica mangiato?! Non abbiamo ancora capito cos'è!"],
13815=>["Value"=>13815,"TextKey"=>"剧情ID2090302","TextValue"=>"Lo schema delle stelle si è allineato per indicare il <color=#f58c26>Gran Canyon</color> a <color=#f58c26>Sud-Est</color>, e il <color=#f58c26>seme sedativo</color> mi aiuterà a incontrare il Grande...* russa*"],
13816=>["Value"=>13816,"TextKey"=>"剧情ID2090303","TextValue"=>"<line-height=130%>Sacerdote? Sacerdote? Sei ancora lì?"],
13817=>["Value"=>13817,"TextKey"=>"剧情ID2090304","TextValue"=>"<line-height=130%>*Russa*"],
13818=>["Value"=>13818,"TextKey"=>"剧情ID2090305","TextValue"=>"<line-height=130%>E si è addormentata. Non riesco proprio a capire queste persone con poteri misteriosi. Sembrano così strane a volte. "],
13819=>["Value"=>13819,"TextKey"=>"剧情ID2090306","TextValue"=>"<line-height=130%>Urrrh, dove dovremmo andare ora che il sacerdote è svenuto?"],
13820=>["Value"=>13820,"TextKey"=>"剧情ID2090307","TextValue"=>"<line-height=130%>Ha detto il <color=#f58c26>Gran Canyon</color> giusto? A <color=#f58c26>sud-est</color>?"],
13821=>["Value"=>13821,"TextKey"=>"剧情ID2090308","TextValue"=>"<line-height=130%>Dovremmo fidarci di lei? Sembra un po'... fuori di sé al momento."],
13822=>["Value"=>13822,"TextKey"=>"剧情ID2090309","TextValue"=>"Sì, ho promesso che mi fiderò di lei in futuro. Inoltre, dove possiamo andare dopo? Riposiamoci per oggi e andiamo a sud-est domani."],
13823=>["Value"=>13823,"TextKey"=>"剧情ID3010101","TextValue"=>"<line-height=130%>Ehi tu!"],
13824=>["Value"=>13824,"TextKey"=>"剧情ID3010102","TextValue"=>"Io?"],
13825=>["Value"=>13825,"TextKey"=>"剧情ID3010103","TextValue"=>"Sì! Tu. Ti dispiace dare una mano a una vecchia signora?"],
13826=>["Value"=>13826,"TextKey"=>"剧情ID3010104","TextValue"=>"Ehm... Non sono proprio qui."],
13827=>["Value"=>13827,"TextKey"=>"剧情ID3010105","TextValue"=>"Uh, e perché?"],
13828=>["Value"=>13828,"TextKey"=>"剧情ID3010106","TextValue"=>"Sono con la gente della mia tribù in questo momento. Siamo in viaggio alla ricerca di eroi che possano aiutarci a risolvere il mistero della nostra casa."],
13829=>["Value"=>13829,"TextKey"=>"剧情ID3010107","TextValue"=>"Capisco. Sto davvero parlando con la tua anima, attraverso quel piccolo blocco luminoso che hai in mano?"],
13830=>["Value"=>13830,"TextKey"=>"剧情ID3010108","TextValue"=>"Il mio... <color=#f58c26>telefono</color>?"],
13831=>["Value"=>13831,"TextKey"=>"剧情ID3010109","TextValue"=>"Sì, esattamente. Il <color=#f58c26>"mio telefono"</color>. Mi aiuteresti?"],
13832=>["Value"=>13832,"TextKey"=>"剧情ID3010110","TextValue"=>"Aspetta... Perché puoi *annusarmi*?"],
13833=>["Value"=>13833,"TextKey"=>"剧情ID3010111","TextValue"=>"Oh tesoro, anche se ho un occhio cieco, posso ancora sentire tutto. Capirai dopo. Ora, mi aiuteresti?"],
13834=>["Value"=>13834,"TextKey"=>"剧情ID3010112","TextValue"=>"Ok... Di cosa hai bisogno?"],
13835=>["Value"=>13835,"TextKey"=>"剧情ID3010113","TextValue"=>"La tua tribù sta per passare, giusto? Faccio finta di avere un disperato bisogno di cibo, e metto su un <color=#f58c26>piccolo chiosco</color> per vendere la mia spazzatura? Oddio, ma che idea meravigliosa!"],
13836=>["Value"=>13836,"TextKey"=>"剧情ID3010114","TextValue"=>"Non sto capendo......"],
13837=>["Value"=>13837,"TextKey"=>"剧情ID3010115","TextValue"=>"Non voglio aiutare dei maleducati a caso, ok? Devi essere gentile per avere il mio aiuto."],
13838=>["Value"=>13838,"TextKey"=>"剧情ID3010116","TextValue"=>"Quindi?"],
13839=>["Value"=>13839,"TextKey"=>"剧情ID3010117","TextValue"=>"Se comprano la mia roba e mi danno da mangiare, sono a posto. E se mi danno direttamente da mangiare, ancora meglio!"],
13840=>["Value"=>13840,"TextKey"=>"剧情ID3010118","TextValue"=>"Altrimenti? Uno schiocco di dita e la tua tribù non c'è più. Capito? Allora vai a raccogliere del materiale per me!"],
13841=>["Value"=>13841,"TextKey"=>"剧情ID3020101","TextValue"=>"Fantastico! Grazie mille a tutti voi! "],
13842=>["Value"=>13842,"TextKey"=>"剧情ID3020102","TextValue"=>"Spero che mia figlia sia affidabile ed efficiente come voi. "],
13843=>["Value"=>13843,"TextKey"=>"剧情ID3020103","TextValue"=>"Ci siamo separati prima nel deserto, e mi sono perso... Il mio senso dell'orientamento non è un granché. "],
13844=>["Value"=>13844,"TextKey"=>"剧情ID3020104","TextValue"=>"Sai dov'è adesso?"],
13845=>["Value"=>13845,"TextKey"=>"剧情ID3020105","TextValue"=>"Certo che so dov'è! Ma non può... non cercarmi! "],
13846=>["Value"=>13846,"TextKey"=>"剧情ID3020201","TextValue"=>"È una bella sensazione. Capisci? Solo io e te, a rilassarci, a chiacchierare un po', a bere del tè..."],
13847=>["Value"=>13847,"TextKey"=>"剧情ID3020301","TextValue"=>"Stanno arrivando. Dobbiamo solo aspettare."],
13848=>["Value"=>13848,"TextKey"=>"剧情ID3020302","TextValue"=>"......"],
13849=>["Value"=>13849,"TextKey"=>"剧情ID3020303","TextValue"=>"È passato molto tempo."],
13850=>["Value"=>13850,"TextKey"=>"剧情ID3020304","TextValue"=>"Mi arrampico su quel cumulo di ossa e guardo dove sono."],
13851=>["Value"=>13851,"TextKey"=>"剧情ID3020401","TextValue"=>"Ah! Certo che sono lì! Quel tuo piccolo sacerdote è incredibilmente carino!"],
13852=>["Value"=>13852,"TextKey"=>"剧情ID3020402","TextValue"=>"Va bene, saranno qui in men che non si dica. Non vedo l'ora di incontrare la tua gente! Devo solo scendere con attenzione..."],
13853=>["Value"=>13853,"TextKey"=>"剧情ID3020501","TextValue"=>"Stai bene?"],
13854=>["Value"=>13854,"TextKey"=>"剧情ID3020502","TextValue"=>"C'è qualcuno?"],
13855=>["Value"=>13855,"TextKey"=>"剧情ID3020601","TextValue"=>"Poco dopo"],
13856=>["Value"=>13856,"TextKey"=>"剧情ID3020701","TextValue"=>"Muoio di fame, per favore compra qualcosa, dammi del cibo per favore. Huh. Sembra che qualcuno abbia avviato una piccola attività qui."],
13857=>["Value"=>13857,"TextKey"=>"剧情ID3020702","TextValue"=>"Ah Capo, eccoti qui. Il sacerdote Enda ha detto che qualcuno del suo sogno ci sta aspettando qui. "],
13858=>["Value"=>13858,"TextKey"=>"剧情ID3020703","TextValue"=>"Vedo alcune tracce di attività umana qui, ma questo falò si è spento, questo piccolo chiosco sta per crollare, e non c'è nessuno in giro... Ci hanno dato buca?"],
13859=>["Value"=>13859,"TextKey"=>"剧情ID3020704","TextValue"=>"Comunque, costruiamo un campo e passiamo la notte qui. Aspetteremo che quella "persona da sogno" si faccia viva."],
13860=>["Value"=>13860,"TextKey"=>"剧情ID3020801","TextValue"=>"Sono cotto... Finalmente... Questo mantello è un forno! Mi sto arrostendo! Toglimelo!"],
13861=>["Value"=>13861,"TextKey"=>"剧情ID3020802","TextValue"=>"Caro sacerdote, stavi dormendo sulla schiena di un cammello poco fa. Non puoi dire "cotto"."],
13862=>["Value"=>13862,"TextKey"=>"剧情ID3020803","TextValue"=>"A proposito, non puoi nemmeno toglierti il mantello. Anche se adesso fa un caldo infernale, di notte si gela."],
13863=>["Value"=>13863,"TextKey"=>"剧情ID3020804","TextValue"=>"Caro dio... Perché chiedermi di venire in questo luogo desolato... e dover sopportare anche questo giovane arrogante..."],
13864=>["Value"=>13864,"TextKey"=>"剧情ID3020805","TextValue"=>"Per favore, abbi un po' di pazienza. Il Capo raccoglierà i materiali che ci servono per costruire una <color=#f58c26>Tenda</color> qui."],
13865=>["Value"=>13865,"TextKey"=>"剧情ID3030101","TextValue"=>"Ben fatto, Capo! Cominciamo!"],
13866=>["Value"=>13866,"TextKey"=>"剧情ID3030201","TextValue"=>"Ottimo! La gente sarà affamata. Sfruttiamo al massimo questo falò e cuciniamo qualcosa. Mangiare bene per lavorare bene!"],
13867=>["Value"=>13867,"TextKey"=>"剧情ID3030202","TextValue"=>"Urrà! Cibo! Pancetta!"],
13868=>["Value"=>13868,"TextKey"=>"剧情ID3030203","TextValue"=>"Costoletta di agnello per me, per favore..."],
13869=>["Value"=>13869,"TextKey"=>"剧情ID3030204","TextValue"=>"Voi selvaggi carnivori!"],
13870=>["Value"=>13870,"TextKey"=>"剧情ID3030205","TextValue"=>"Allora, cosa vuoi?"],
13871=>["Value"=>13871,"TextKey"=>"剧情ID3030206","TextValue"=>"Bistecca, cottura media con salsa di rafano, per favore."],
13872=>["Value"=>13872,"TextKey"=>"剧情ID3030207","TextValue"=>"Sacerdote, anche questo è..."],
13873=>["Value"=>13873,"TextKey"=>"剧情ID3030208","TextValue"=>"Lo so! Zitto!"],
13874=>["Value"=>13874,"TextKey"=>"剧情ID3030209","TextValue"=>"Ahahah, le proteine sono molto importanti per chi viaggia. È stato un viaggio duro, quindi festeggiamo! Che ne dici, Capo?"],
13875=>["Value"=>13875,"TextKey"=>"剧情ID3030210","TextValue"=>"Non abbiamo molto materiale per cucinare..."],
13876=>["Value"=>13876,"TextKey"=>"剧情ID3030211","TextValue"=>"Abbiamo montone, carne essiccata e mele, capo!"],
13877=>["Value"=>13877,"TextKey"=>"剧情ID3030212","TextValue"=>"Ma il capo ha ragione, dobbiamo conservarne un po' per le notti più dure. Ci serve una fonte di proteine alternativa."],
13878=>["Value"=>13878,"TextKey"=>"剧情ID3030213","TextValue"=>"Ho avvistato alcune lucertole del deserto. Sia le lucertole che le loro uova dovrebbero essere ottime fonti di proteine!"],
13879=>["Value"=>13879,"TextKey"=>"剧情ID3030214","TextValue"=>"Cosa hai detto?! Lucertole?! Come possiamo mangiare le lucertole?!"],
13880=>["Value"=>13880,"TextKey"=>"剧情ID3030215","TextValue"=>"Ci sono un sacco di prelibatezze che possiamo preparare con un po' di immaginazione! Per esempio, lo "stufato di lucertola" suona particolarmente attraente!"],
13881=>["Value"=>13881,"TextKey"=>"剧情ID3030216","TextValue"=>"Non vedo l'ora!"],
13882=>["Value"=>13882,"TextKey"=>"剧情ID3030217","TextValue"=>"Oh... Caccia alla lucertola..."],
13883=>["Value"=>13883,"TextKey"=>"剧情ID3040101","TextValue"=>"Incredibile! Hai raccolto tutti i materiali! Muoviamoci!"],
13884=>["Value"=>13884,"TextKey"=>"剧情ID3040102","TextValue"=>"Arrivo! Accendi il fuoco!"],
13885=>["Value"=>13885,"TextKey"=>"剧情ID3040201","TextValue"=>"Finalmente... Cibo... Non riesco nemmeno a muovermi... Uovo all'occhio di bue... Bistecca... Mela al forno..."],
13886=>["Value"=>13886,"TextKey"=>"剧情ID3040202","TextValue"=>"Braciola di montone per Arlan, uovo all'occhio di bue per Kevin... E il sacerdote Enda dividerà con me questa ciotola di delizioso stufato di lucertola..."],
13887=>["Value"=>13887,"TextKey"=>"剧情ID3040301","TextValue"=>"Nessuno condivide lo stufato di lucertola!"],
13888=>["Value"=>13888,"TextKey"=>"剧情ID3040302","TextValue"=>"In questo caso, darò questa ciotola di caldo, fumante, delizioso stufato ai nostri nuovi amici."],
13889=>["Value"=>13889,"TextKey"=>"剧情ID3040303","TextValue"=>"Nuovi amici? Quali nuovi amici?"],
13890=>["Value"=>13890,"TextKey"=>"剧情ID3040401","TextValue"=>"Ah!!! Noooo!!!! Toglietemi questi ratti di dosso!!!!"],
13891=>["Value"=>13891,"TextKey"=>"剧情ID3040402","TextValue"=>"Sono troppo grossi per essere dei ratti. Secondo il mio modesto parere, questi sono Maubbits, una specie di roditori unici delle regioni aride."],
13892=>["Value"=>13892,"TextKey"=>"剧情ID3040403","TextValue"=>"Di solito sono sorprendentemente timidi, considerando le loro dimensioni impressionanti, il che li rende completamente innocui nei confronti degli esseri umani."],
13893=>["Value"=>13893,"TextKey"=>"剧情ID3040404","TextValue"=>"Ok ok lo so!!! Non mi interessa cosa sono! Toglietemeli di dosso!"],
13894=>["Value"=>13894,"TextKey"=>"剧情ID3040405","TextValue"=>"Ora che l'hai detto, è abbastanza strano che non abbiano paura di te..."],
13895=>["Value"=>13895,"TextKey"=>"剧情ID3040406","TextValue"=>"Cari lavoratori, sareste così gentili da rimuovere queste adorabili creature dal nostro sacerdote?"],
13896=>["Value"=>13896,"TextKey"=>"剧情ID3040407","TextValue"=>"Sì!"],
13897=>["Value"=>13897,"TextKey"=>"剧情ID3040501","TextValue"=>"Ehi! Rimangiatelo!"],
13898=>["Value"=>13898,"TextKey"=>"剧情ID3040502","TextValue"=>"Mmmh, e se ne vanno. Sembra che abbiano ancora paura di tutti tranne che del sacerdote."],
13899=>["Value"=>13899,"TextKey"=>"剧情ID3040503","TextValue"=>"Hanno preso il mio anello! Il mio amato anello..."],
13900=>["Value"=>13900,"TextKey"=>"剧情ID3040504","TextValue"=>"Povero sacerdote, immagino che possiamo seguire i loro passi nei resti del drago? Comunque sono abbastanza curioso di quei piccoletti. "],
13901=>["Value"=>13901,"TextKey"=>"剧情ID3040505","TextValue"=>"E per farlo, abbiamo bisogno di un <color=#f58c26>Mulino</color> che ci aiuti a trasportare la gente su e giù, considerando quanto è ripida quella montagna."],
13902=>["Value"=>13902,"TextKey"=>"剧情ID3050101","TextValue"=>"Siamo già tutti pronti con i materiali del <color=#f58c26>Mulino</color>?! Incredibile!"],
13903=>["Value"=>13903,"TextKey"=>"剧情ID3050102","TextValue"=>"Mulino nuovo di zecca in arrivo!"],
13904=>["Value"=>13904,"TextKey"=>"剧情ID3050201","TextValue"=>"Che bello! Ora è molto più sicuro e comodo andare su e giù per il pendio!"],
13905=>["Value"=>13905,"TextKey"=>"剧情ID3050202","TextValue"=>"Grande! Sbrigati a riportare il mio anello! Quella cosa è sacra!"],
13906=>["Value"=>13906,"TextKey"=>"剧情ID3050203","TextValue"=>"Ok ok andiamo! Kevin, Arlan, siete pronti?"],
13907=>["Value"=>13907,"TextKey"=>"剧情ID3050204","TextValue"=>"Come sempre!"],
13908=>["Value"=>13908,"TextKey"=>"剧情ID3050205","TextValue"=>"Uh... Signore... Non che io sia un codardo, ma penso che abbiamo ancora bisogno di corde nel caso in cui cadessimo dalla scogliera..."],
13909=>["Value"=>13909,"TextKey"=>"剧情ID3050206","TextValue"=>"Ahah, hai assolutamente ragione! La sicurezza sul lavoro è importante! Quindi, capo, vai a prendere l'equipaggiamento necessario!"],
13910=>["Value"=>13910,"TextKey"=>"剧情ID3060101","TextValue"=>"Siamo pronti ora?"],
13911=>["Value"=>13911,"TextKey"=>"剧情ID3060102","TextValue"=>"Sì!"],
13912=>["Value"=>13912,"TextKey"=>"剧情ID3060103","TextValue"=>"Bellissimo! Andiamo subito a risolvere il mistero dei Maubbits! Che emozione!"],
13913=>["Value"=>13913,"TextKey"=>"剧情ID3060104","TextValue"=>"E riportatemi il mio anello!"],
13914=>["Value"=>13914,"TextKey"=>"剧情ID3060201","TextValue"=>"Wow, questo sì che è un gran bel mucchio di ossa! Aspetta... C'è una cosa luccicante sul fondo... Mmmh... Che sia l'anello di Enda?"],
13915=>["Value"=>13915,"TextKey"=>"剧情ID3060202","TextValue"=>"Capo! Guarda cosa abbiamo trovato! Una vecchia donna ricoperta di terra!"],
13916=>["Value"=>13916,"TextKey"=>"剧情ID3060203","TextValue"=>"E l'anello del sacerdote."],
13917=>["Value"=>13917,"TextKey"=>"剧情ID3060301","TextValue"=>"*Commosso* Grazie, Arlan, il più sensibile di tutti noi... Aspetta... Cosa?"],
13918=>["Value"=>13918,"TextKey"=>"剧情ID3060401","TextValue"=>"*Rumori concitati*"],
13919=>["Value"=>13919,"TextKey"=>"剧情ID3060402","TextValue"=>"Presumo che... Grazie?"],
13920=>["Value"=>13920,"TextKey"=>"剧情ID3060403","TextValue"=>"*Rumori felici*"],
13921=>["Value"=>13921,"TextKey"=>"剧情ID3060501","TextValue"=>"*Rumori concitati*"],
13922=>["Value"=>13922,"TextKey"=>"剧情ID3060502","TextValue"=>"Oh, ciao! Ciao! Sei così accogliente! Ti conosco? La tua pelliccia mi sembra piuttosto familiare..."],
13923=>["Value"=>13923,"TextKey"=>"剧情ID3060503","TextValue"=>"Oh, e tu devi essere il piccolo sacerdote del mio sogno! Sei anche più piccolo nella vita reale!"],
13924=>["Value"=>13924,"TextKey"=>"剧情ID3060504","TextValue"=>"Piccolo? Come osi chiamarmi piccolo?! Sono il nobile messaggero divino..."],
13925=>["Value"=>13925,"TextKey"=>"剧情ID3060505","TextValue"=>"Scusa, hai detto che hai sognato il nostro sacerdote?"],
13926=>["Value"=>13926,"TextKey"=>"剧情ID3060506","TextValue"=>"Oh~ Giovane! Sì! Ho sognato di dire al vostro piccolo sacerdote: "Ti aspetterò". Ma non so assolutamente cosa significhi!"],
13927=>["Value"=>13927,"TextKey"=>"剧情ID3060507","TextValue"=>"Cosa vuol dire con non sai cosa significa?!"],
13928=>["Value"=>13928,"TextKey"=>"剧情ID3060508","TextValue"=>"In realtà, questo è divertente. Non ricordo affatto il mio nome, quindi non so cosa significhi quello strano sogno. "],
13929=>["Value"=>13929,"TextKey"=>"剧情ID3060509","TextValue"=>"Devo aver battuto la testa piuttosto forte mentre cadevo nella fossa. Mi reggo ancora un po' a fatica in piedi. "],
13930=>["Value"=>13930,"TextKey"=>"剧情ID3060510","TextValue"=>"Questo piccolo chiosco è tuo? C'è scritto "Affamata, per favore compra la mia roba, dammi da mangiare per favore"."],
13931=>["Value"=>13931,"TextKey"=>"剧情ID3060511","TextValue"=>"Dato che quello che c'è scritto su questo chiosco mi si addice, e che siamo in mezzo al deserto, sì, credo che sia mio."],
13932=>["Value"=>13932,"TextKey"=>"剧情ID3060512","TextValue"=>"Oh! Nessun problema! Abbiamo del cibo. Vieni a mangiarlo nella nostra tenda."],
13933=>["Value"=>13933,"TextKey"=>"剧情ID3060513","TextValue"=>"Sarebbe fantastico!"],
13934=>["Value"=>13934,"TextKey"=>"剧情ID3060514","TextValue"=>"Oh, una cosa però, sento odore di pancetta, mele al forno, e... <color=#f58c26>un temporale imminente</color> nell'aria. È meglio essere pronti. "],
13935=>["Value"=>13935,"TextKey"=>"剧情ID3060601","TextValue"=>"E... Ecco che se ne va. Va bene allora, Capo, sono sicuro che hai sentito, il vento infuria qui, fammi vedere..."],
13936=>["Value"=>13936,"TextKey"=>"剧情ID3060602","TextValue"=>"La nostra tenda ha bisogno di qualche rinforzo sulla parte superiore per appesantirla."],
13937=>["Value"=>13937,"TextKey"=>"剧情ID3060603","TextValue"=>"Perché dobbiamo stare ad ascoltarla? Non sappiamo nemmeno da dove viene e tu credi a quello che dice! "],
13938=>["Value"=>13938,"TextKey"=>"剧情ID3060604","TextValue"=>"Le mie predizioni... Basta un errore e non fai che prendermi in giro! Scoprirò le vere intenzioni di quella donna, vedrai!"],
13939=>["Value"=>13939,"TextKey"=>"剧情ID3060605","TextValue"=>"Ooooh, qualcuno sta diventando competitivo. Comunque, Capo, ho fatto la lista dei materiali necessari per <color=#f58c26>rinforzare la tenda</color>, dai un'occhiata."],
13940=>["Value"=>13940,"TextKey"=>"剧情ID3070101","TextValue"=>"Emm, buon tè."],
13941=>["Value"=>13941,"TextKey"=>"剧情ID3070102","TextValue"=>"E anche questo biscotto è abbastanza buono, si scioglie in bocca. Anche se è un po' bruciato all'esterno. "],
13942=>["Value"=>13942,"TextKey"=>"剧情ID3070103","TextValue"=>"Dovresti abbassare la temperatura la prossima volta e cuocerlo più a lungo."],
13943=>["Value"=>13943,"TextKey"=>"剧情ID3070104","TextValue"=>"Perché sta prendendo il tè del pomeriggio?"],
13944=>["Value"=>13944,"TextKey"=>"剧情ID3070105","TextValue"=>"Qual è il problema?"],
13945=>["Value"=>13945,"TextKey"=>"剧情ID3070106","TextValue"=>"E cos'è questo strano accento britannico! Non siamo nemmeno nell'epoca giusta!"],
13946=>["Value"=>13946,"TextKey"=>"剧情ID3070107","TextValue"=>"Rilassati, piccolo sacerdote. Andrà tutto bene. Capirai."],
13947=>["Value"=>13947,"TextKey"=>"剧情ID3070108","TextValue"=>"No! Niente andrà bene! E io non capirò nulla! Caro dio... Da dove diavolo è uscita questa donna..."],
13948=>["Value"=>13948,"TextKey"=>"剧情ID3070109","TextValue"=>"Visto che me l'hai chiesto in totale onestà, infatti, grazie al tè pomeridiano che mi sono gustata poco fa..."],
13949=>["Value"=>13949,"TextKey"=>"剧情ID3070110","TextValue"=>"Credo di aver recuperato alcuni dei miei ricordi. In realtà, quello che voglio dire, in tutta onestà, il fatto è che..."],
13950=>["Value"=>13950,"TextKey"=>"剧情ID3070111","TextValue"=>"Forza, sputa il rospo!"],
13951=>["Value"=>13951,"TextKey"=>"剧情ID3070112","TextValue"=>"Non è che rinforzeresti quel <color=#f58c26>piccolo chiosco</color> lì fuori per me?"],
13952=>["Value"=>13952,"TextKey"=>"剧情ID3070113","TextValue"=>"Cosa?!"],
13953=>["Value"=>13953,"TextKey"=>"剧情ID3070114","TextValue"=>"Vecchia e allampanata, ho camminato per giorni da sola, costruendo questo chiosco mentre morivo di fame... Oh, povera me!"],
13954=>["Value"=>13954,"TextKey"=>"剧情ID3070115","TextValue"=>"Sarebbe devastante per me se il chiosco si rompesse. Il mio destino è nelle tue mani! Ti sono immensamente grata!"],
13955=>["Value"=>13955,"TextKey"=>"剧情ID3070116","TextValue"=>"Che donna interessante."],
13956=>["Value"=>13956,"TextKey"=>"剧情ID3070117","TextValue"=>"Scusa, che hai detto?!"],
13957=>["Value"=>13957,"TextKey"=>"剧情ID3070118","TextValue"=>"Capo, ti ho preparato la lista dei materiali, dai un'occhiata."],
13958=>["Value"=>13958,"TextKey"=>"剧情ID3070119","TextValue"=>"Non ignorarmi!!!!! Cavolo, non lo sopporto più!"],
13959=>["Value"=>13959,"TextKey"=>"剧情ID3080101","TextValue"=>"Bellissimo! Siete fantastici!"],
13960=>["Value"=>13960,"TextKey"=>"剧情ID3080102","TextValue"=>"Mamma! Lo sapevo! Lo sapevo che eri tu!"],
13961=>["Value"=>13961,"TextKey"=>"剧情ID3080201","TextValue"=>"Grande Tlachtga, come mai sei qui?!"],
13962=>["Value"=>13962,"TextKey"=>"剧情ID3080202","TextValue"=>"E questa signorina è?"],
13963=>["Value"=>13963,"TextKey"=>"剧情ID3080203","TextValue"=>"Tlachtga! Tua figlia! Smettila di fare il finto tonto! "],
13964=>["Value"=>13964,"TextKey"=>"剧情ID3080204","TextValue"=>"Il messaggero mi ha detto che hanno disseppellito una vecchia cieca da un mucchio di ossa, la descrizione corispondeva, quindi tanto valeva venire a controllare."],
13965=>["Value"=>13965,"TextKey"=>"剧情ID3080205","TextValue"=>"Non sono affatto sorpresa di vederti qui."],
13966=>["Value"=>13966,"TextKey"=>"剧情ID3080206","TextValue"=>"La madre di Tlachtga... Non ho mai sentito che Tlachtga avesse una madre..."],
13967=>["Value"=>13967,"TextKey"=>"剧情ID3080207","TextValue"=>"Certo che ho una madre, idiota!"],
13968=>["Value"=>13968,"TextKey"=>"剧情ID3080208","TextValue"=>"Il linguaggio."],
13969=>["Value"=>13969,"TextKey"=>"剧情ID3080209","TextValue"=>"Come vuoi, questa pazza in piedi davanti a te è Mug Ruith."],
13970=>["Value"=>13970,"TextKey"=>"剧情ID3080210","TextValue"=>"Chiamami Meg."],
13971=>["Value"=>13971,"TextKey"=>"剧情ID3080211","TextValue"=>"E io che pensavo che Mug Ruith fosse un uomo..."],
13972=>["Value"=>13972,"TextKey"=>"剧情ID3080212","TextValue"=>"Beh, mia madre può essere un sacco di cose nei racconti. Nascondeva la sua vera identità alla gente quando ero piccola."],
13973=>["Value"=>13973,"TextKey"=>"剧情ID3080213","TextValue"=>"Sai com'è... Come puoi non prenderti gioco di una donna cieca e di sua figlia di tre anni?"],
13974=>["Value"=>13974,"TextKey"=>"剧情ID3080214","TextValue"=>"Credo che sia così che la storia ha cominciato a diffondersi... Un druido onnipotente e onnisciente, un guerriero cieco, un potente cavaliere..."],
13975=>["Value"=>13975,"TextKey"=>"剧情ID3080215","TextValue"=>"Mentre in realtà è solo una vecchia cieca con uno strano senso dell'umorismo."],
13976=>["Value"=>13976,"TextKey"=>"剧情ID3080216","TextValue"=>"Mug Ruith è una donna... E io sono stato un maleducato con Mug Ruith... Oh... Sarò condannato... Sono una disgrazia come sacerdote..."],
13977=>["Value"=>13977,"TextKey"=>"剧情ID3080217","TextValue"=>"Piccolo sacerdote, non essere così cupo. Migliorerai nella gentilezza~ Per questa volta ti perdono, sei così carino!~"],
13978=>["Value"=>13978,"TextKey"=>"剧情ID3080218","TextValue"=>"Quindi ci hai ingannato? Non hai perso la memoria?"],
13979=>["Value"=>13979,"TextKey"=>"剧情ID3080219","TextValue"=>"Sì... Mi dispiace. I lunghi viaggi possono essere noiosi, sai? Mi stavo solo divertendo~ "],
13980=>["Value"=>13980,"TextKey"=>"剧情ID3080220","TextValue"=>"Ma ehi, guarda che bella tenda e che bel chiosco! Ora sì che sembra un campo! Sebbene ancora un po' sprovvisto."],
13981=>["Value"=>13981,"TextKey"=>"剧情ID3080221","TextValue"=>"E cosa mancherebbe?"],
13982=>["Value"=>13982,"TextKey"=>"剧情ID3080222","TextValue"=>"Fammi vedere..."],
13983=>["Value"=>13983,"TextKey"=>"剧情ID3080301","TextValue"=>"Un cancello! Avete bisogno di un cancello per segnare l'ingresso del Campo, poi alcune luci e sarà più bello che mai!"],
13984=>["Value"=>13984,"TextKey"=>"剧情ID3080302","TextValue"=>"Saremo i vostri più umili servitori e andremo a costruire quel cancello, signora! Capo, rimettiti insieme!"],
13985=>["Value"=>13985,"TextKey"=>"剧情ID3090101","TextValue"=>"Abbiamo tutto? Benissimo! Presto, presto!"],
13986=>["Value"=>13986,"TextKey"=>"剧情ID3090201","TextValue"=>"Oh! Così rigenerante! Questo è il primo progetto di costruzione che dirigo..."],
13987=>["Value"=>13987,"TextKey"=>"剧情ID3090202","TextValue"=>"Congratulazioni, sacerdote, sei cresciuto così tanto! Ma non so se Meg è soddisfatta di come appare ora il nostro campo?"],
13988=>["Value"=>13988,"TextKey"=>"剧情ID3090203","TextValue"=>"Tutto il resto va bene, ma il cielo vuoto sembra piuttosto noioso..."],
13989=>["Value"=>13989,"TextKey"=>"剧情ID3090204","TextValue"=>"Lo so! Lo so! Abbiamo dei palloncini di segnalazione che possono galleggiare nel cielo!"],
13990=>["Value"=>13990,"TextKey"=>"剧情ID3090205","TextValue"=>"È un'idea meravigliosa! Solo che abbiamo bisogno di qualche piccolo ritocco per renderla più piccante. "],
13991=>["Value"=>13991,"TextKey"=>"剧情ID3090206","TextValue"=>"Avete ancora quelle rocce luccicanti gialle e rosa?"],
13992=>["Value"=>13992,"TextKey"=>"剧情ID3090207","TextValue"=>"Sì, le abbiamo!"],
13993=>["Value"=>13993,"TextKey"=>"剧情ID3090208","TextValue"=>"Incredibile. Datemi un momento. Kevin, vieni."],
13994=>["Value"=>13994,"TextKey"=>"剧情ID3090301","TextValue"=>"Uff, che fatica. Ma guarda questi, non sono bellissimi?"],
13995=>["Value"=>13995,"TextKey"=>"剧情ID3090302","TextValue"=>"Sì, lo sono."],
13996=>["Value"=>13996,"TextKey"=>"剧情ID3090303","TextValue"=>"Mi fa piacere che ti piacciano. È raro che la mamma faccia qualcosa di normale. Comunque, si sta facendo tardi, ora torno a casa. "],
13997=>["Value"=>13997,"TextKey"=>"剧情ID3090304","TextValue"=>"Te ne vai di già?"],
13998=>["Value"=>13998,"TextKey"=>"剧情ID3090305","TextValue"=>"Sì, o cosa? Non ho intenzione di coccolarmi con voi puzzolenti in quella piccola tenda! Mamma, vieni con me?"],
13999=>["Value"=>13999,"TextKey"=>"剧情ID3090306","TextValue"=>"Ti raggiungo dopo. I tuoi nuovi amici sembrano adorabili, specialmente questo piccolo sacerdote così carino~! Vorrei trascorrere un momento con loro~"],
14000=>["Value"=>14000,"TextKey"=>"剧情ID3090307","TextValue"=>"Mamma, controllati."],
14001=>["Value"=>14001,"TextKey"=>"剧情ID3090308","TextValue"=>"Lo so, lo so, ora sono ben controllata. Dopo tutto, abbiamo ancora un lungo viaggio che ci aspetta."],
14002=>["Value"=>14002,"TextKey"=>"剧情ID3090309","TextValue"=>"Va bene allora. Ci vediamo."],
14003=>["Value"=>14003,"TextKey"=>"剧情ID3090401","TextValue"=>"Stavi dicendo che ti unirai a noi?"],
14004=>["Value"=>14004,"TextKey"=>"剧情ID3090402","TextValue"=>"Certo, perché no! La vostra avventura sarà sempre più pericolosa. "],
14005=>["Value"=>14005,"TextKey"=>"剧情ID3090403","TextValue"=>"Non c'è molto che io possa fare, ma almeno posso far luce su ciò che deve ancora accadere."],
14006=>["Value"=>14006,"TextKey"=>"剧情ID3090404","TextValue"=>"Ma ho bisogno che tu mi indichi la strada per la tua Terra natia. Il mio senso dell'orientamento è... incredibilmente pessimo."],
14007=>["Value"=>14007,"TextKey"=>"剧情ID4010101","TextValue"=>"Ahi... Perché esiste un posto simile sulla terra?! I miei piedi amano camminare in continuazione sul fuoco..."],
14008=>["Value"=>14008,"TextKey"=>"剧情ID4010102","TextValue"=>"Incredibile, Enda! Sigh... non hai detto altro che cinque parole nelle ultime quattro ore."],
14009=>["Value"=>14009,"TextKey"=>"剧情ID4010103","TextValue"=>"Troppa... stanchezza... troppo caldo..."],
14010=>["Value"=>14010,"TextKey"=>"剧情ID4010104","TextValue"=>"Siete come bamboline delicate! Si tratta semplicemente di un vulcano. Sembra che stiate per buttarvi per terra!"],
14011=>["Value"=>14011,"TextKey"=>"剧情ID4010105","TextValue"=>"Signora... Anche lei sta sudando copiosamente. Va tutto bene?"],
14012=>["Value"=>14012,"TextKey"=>"剧情ID4010106","TextValue"=>"Chiamami Tlachtga! ... Non sono stanca, ma fa molto caldo qui... è molto più pericoloso del mare."],
14013=>["Value"=>14013,"TextKey"=>"剧情ID4010107","TextValue"=>"A quanto pare siamo arrivati."],
14014=>["Value"=>14014,"TextKey"=>"剧情ID4010108","TextValue"=>"Fatemi vedere! Secondo le istruzioni della Dea, all'interno del mare di fuoco vi sono alcune isole..."],
14015=>["Value"=>14015,"TextKey"=>"剧情ID4010109","TextValue"=>"Sì, dev'essere qui!"],
14016=>["Value"=>14016,"TextKey"=>"剧情ID4010110","TextValue"=>"Ma dov'è Amergin? Amergin dovrebbe essere già qui ad aspettarci. Ma non si vede da nessuna parte."],
14017=>["Value"=>14017,"TextKey"=>"剧情ID4010111","TextValue"=>"Dovrei costruire un altare per intercettare le tracce di Amergin. Però..."],
14018=>["Value"=>14018,"TextKey"=>"剧情ID4010201","TextValue"=>"Oh... Capo, io..."],
14019=>["Value"=>14019,"TextKey"=>"剧情ID4010202","TextValue"=>"Enda!"],
14020=>["Value"=>14020,"TextKey"=>"剧情ID4010203","TextValue"=>"Enda!"],
14021=>["Value"=>14021,"TextKey"=>"剧情ID4010204","TextValue"=>"Deve aver avuto un colpo di calore! Costruite un parasole e fatela riposare!"],
14022=>["Value"=>14022,"TextKey"=>"剧情ID4020101","TextValue"=>"Signore, la costruzione è terminata!"],
14023=>["Value"=>14023,"TextKey"=>"剧情ID4020102","TextValue"=>"Mia dea, a quanto pare vivrò ancora un po'..."],
14024=>["Value"=>14024,"TextKey"=>"剧情ID4020103","TextValue"=>"Fa davvero troppo caldo! Mi manca tantissimo l'odore del mare..."],
14025=>["Value"=>14025,"TextKey"=>"剧情ID4020104","TextValue"=>"Fiu, il nostro sacerdote sembra stare molto meglio."],
14026=>["Value"=>14026,"TextKey"=>"剧情ID4020105","TextValue"=>"Con una tenda che ci protegge da quest'aria bollente che non lascia scampo va un po' meglio."],
14027=>["Value"=>14027,"TextKey"=>"剧情ID4020106","TextValue"=>"Ma solo un po'."],
14028=>["Value"=>14028,"TextKey"=>"剧情ID4020107","TextValue"=>"Santissima dea! Girami, così posso arrostirmi anche dall'altra parte..."],
14029=>["Value"=>14029,"TextKey"=>"剧情ID4020108","TextValue"=>"Devo dire che sembra di stare su un enorme fornello."],
14030=>["Value"=>14030,"TextKey"=>"剧情ID4020109","TextValue"=>"Guardate! Il bassopiano laggiù!"],
14031=>["Value"=>14031,"TextKey"=>"剧情ID4020110","TextValue"=>"Occhio, ragazzi! Mia madre ha dato alla luce un vero e proprio genio."],
14032=>["Value"=>14032,"TextKey"=>"剧情ID4030101","TextValue"=>"Meraviglioso, Tlachtga! Quella è acqua! ACQUA!!!"],
14033=>["Value"=>14033,"TextKey"=>"剧情ID4030102","TextValue"=>"Ah, credevo che il nostro pio sacerdote avesse visto la dea."],
14034=>["Value"=>14034,"TextKey"=>"剧情ID4030103","TextValue"=>"Sono di nuovo in piedi e mi sento alla grande!"],
14035=>["Value"=>14035,"TextKey"=>"剧情ID4030104","TextValue"=>"Anche voi mi sembrate decisamente più in forma!"],
14036=>["Value"=>14036,"TextKey"=>"剧情ID4030105","TextValue"=>"Se è così... tu, tu e tu, sbrigatevi e andate a costruire un Anello di addestramento!"],
14037=>["Value"=>14037,"TextKey"=>"剧情ID4030106","TextValue"=>"Anello di addestramento?"],
14038=>["Value"=>14038,"TextKey"=>"剧情ID4030107","TextValue"=>"Sì, esatto!"],
14039=>["Value"=>14039,"TextKey"=>"剧情ID4030108","TextValue"=>"Non dovremmo cercare Amergin?"],
14040=>["Value"=>14040,"TextKey"=>"剧情ID4030109","TextValue"=>"Amergin… quel vecchietto. So che può controllare le forze della natura come se niente fosse."],
14041=>["Value"=>14041,"TextKey"=>"剧情ID4030110","TextValue"=>"Tornando a noi, ragazzi, camminare fino qui ci ha davvero prosciugati. Come si può tralasciare l'allenamento?"],
14042=>["Value"=>14042,"TextKey"=>"剧情ID4030111","TextValue"=>"Beh, Enda deve allenarsi di più."],
14043=>["Value"=>14043,"TextKey"=>"剧情ID4030112","TextValue"=>"Silenzio!"],
14044=>["Value"=>14044,"TextKey"=>"剧情ID4030113","TextValue"=>"Secondo la profezia di mia madre, ad attenderci ci sono solo tempeste più forti..."],
14045=>["Value"=>14045,"TextKey"=>"剧情ID4030114","TextValue"=>"La profezia di Mug Ruith..."],
14046=>["Value"=>14046,"TextKey"=>"剧情ID4030115","TextValue"=>"Giovani uomini!"],
14047=>["Value"=>14047,"TextKey"=>"剧情ID4030116","TextValue"=>"Tutto chiaro!"],
14048=>["Value"=>14048,"TextKey"=>"剧情ID4040101","TextValue"=>"Guardate l'altopiano a nord! C'è una scala naturale."],
14049=>["Value"=>14049,"TextKey"=>"剧情ID4040102","TextValue"=>"Sì, signore!"],
14050=>["Value"=>14050,"TextKey"=>"剧情ID4040103","TextValue"=>"Avete notato la colonna in mezzo? Non può essere naturale. "],
14051=>["Value"=>14051,"TextKey"=>"剧情ID4040104","TextValue"=>"Con quel peso e quella forma... scommetto la reputazione della famiglia del sacerdote che dovesse essere un altare anticamente!"],
14052=>["Value"=>14052,"TextKey"=>"剧情ID4040105","TextValue"=>"Questo altare sembra abbandonato."],
14053=>["Value"=>14053,"TextKey"=>"剧情ID4040106","TextValue"=>"Già, dev'essere molto vecchio."],
14054=>["Value"=>14054,"TextKey"=>"剧情ID4040107","TextValue"=>"Un altare simile, non in grado di funzionare con il potere dell'Arcidruido, non può aiutarci a trovare Amergin."],
14055=>["Value"=>14055,"TextKey"=>"剧情ID4040108","TextValue"=>"Capo, ci serve un mezzo per concentrare l'energia…"],
14056=>["Value"=>14056,"TextKey"=>"剧情ID4040109","TextValue"=>"I materiali devono essere in grado di resistere alle alte temperature di qui e la forma deve essere ripiegata verso l'interno."],
14057=>["Value"=>14057,"TextKey"=>"剧情ID4040110","TextValue"=>"E queste strane zanne vicino alla lava?"],
14058=>["Value"=>14058,"TextKey"=>"剧情ID4040111","TextValue"=>"Non male, Arlan! Non c'è da stupirsi che il suggerimento della dea al momento della separazione sia stato "resta vicino ai compagni importanti"!"],
14059=>["Value"=>14059,"TextKey"=>"剧情ID4040112","TextValue"=>"Certo! Un grazie alla dea!"],
14060=>["Value"=>14060,"TextKey"=>"剧情ID4040113","TextValue"=>"Silenzio! Non stavamo parlando di te!"],
14061=>["Value"=>14061,"TextKey"=>"剧情ID4040114","TextValue"=>"Lasciamo tutti i materiali al nostro fantastico capo!"],
14062=>["Value"=>14062,"TextKey"=>"剧情ID4050101","TextValue"=>"Capo, stiamo facendo un sacco di progressi."],
14063=>["Value"=>14063,"TextKey"=>"剧情ID4050102","TextValue"=>"L'altare dovrebbe essere utilizzabile!"],
14064=>["Value"=>14064,"TextKey"=>"剧情ID4050103","TextValue"=>"Ma guardate che cielo! Enda non si è risparmiata andando su e giù per le scale dell'altare. E se dovesse cadere?"],
14065=>["Value"=>14065,"TextKey"=>"剧情ID4050104","TextValue"=>"Non male, qualcosa... Alla fine non sei così irritante, a volte."],
14066=>["Value"=>14066,"TextKey"=>"剧情ID4050105","TextValue"=>"Dopotutto, Enda è anziana... ehm... non è più giovane."],
14067=>["Value"=>14067,"TextKey"=>"剧情ID4050106","TextValue"=>"Cosa ci guadagni a darmi fastidio?"],
14068=>["Value"=>14068,"TextKey"=>"剧情ID4050107","TextValue"=>"Costruiamo torce da entrambi i lati delle scale. È semplicissimo!"],
14069=>["Value"=>14069,"TextKey"=>"剧情ID4060101","TextValue"=>"Sento che questo altare... è ancora incompleto, perché non percepisco affatto la dea..."],
14070=>["Value"=>14070,"TextKey"=>"剧情ID4060102","TextValue"=>"Ma dovrebbe bastare per percepire Amergin!"],
14071=>["Value"=>14071,"TextKey"=>"剧情ID4060103","TextValue"=>"Fa freddo... argh... chi c'è?"],
14072=>["Value"=>14072,"TextKey"=>"剧情ID4060104","TextValue"=>"Amergin! Dove sei?"],
14073=>["Value"=>14073,"TextKey"=>"剧情ID4060105","TextValue"=>"Sei... sei Enda? Non ho idea di dove sono... ma fa un freddo qui..."],
14074=>["Value"=>14074,"TextKey"=>"剧情ID4060106","TextValue"=>"Freddo?"],
14075=>["Value"=>14075,"TextKey"=>"剧情ID4060107","TextValue"=>"A quanto pare non è qui."],
14076=>["Value"=>14076,"TextKey"=>"剧情ID4060108","TextValue"=>"Non riesco a muovermi... Aiuto, $#^*,!@%&:?""],
14077=>["Value"=>14077,"TextKey"=>"剧情ID4060109","TextValue"=>"Che hai detto?"],
14078=>["Value"=>14078,"TextKey"=>"剧情ID4060110","TextValue"=>"Ehi, Enda, credo che..."],
14079=>["Value"=>14079,"TextKey"=>"剧情ID4060111","TextValue"=>"L"&%*@#$"…"],
14080=>["Value"=>14080,"TextKey"=>"剧情ID4060112","TextValue"=>"Amergin! Resisti! Devo parlare con un'altra persona ora, potrebbe aiutarti."],
14081=>["Value"=>14081,"TextKey"=>"剧情ID4060113","TextValue"=>"Tlachtga, hai mai visto una situazione simile in passato?"],
14082=>["Value"=>14082,"TextKey"=>"剧情ID4060114","TextValue"=>"Ehi…"],
14083=>["Value"=>14083,"TextKey"=>"剧情ID4060115","TextValue"=>"La comunicazione spirituale non è il mio campo. Ma mia madre ha vissuto la stessa esperienza. Il problema dovrebbe essere l'altare."],
14084=>["Value"=>14084,"TextKey"=>"剧情ID4060116","TextValue"=>"Il potere dell'altare è ancora debole. Manca la cosa più importante."],
14085=>["Value"=>14085,"TextKey"=>"剧情ID4060117","TextValue"=>"Il potere della dea... @#$>:%^Essenza"],
14086=>["Value"=>14086,"TextKey"=>"剧情ID4060118","TextValue"=>"Capo, penso di averlo trovato. Guarda il buco in cima alla colonna dell'altare!"],
14087=>["Value"=>14087,"TextKey"=>"剧情ID4060119","TextValue"=>"Dobbiamo riempire l'Essenza spirituale e migliorare il potere dell'altare. Ne abbiamo?"],
14088=>["Value"=>14088,"TextKey"=>"剧情ID4060120","TextValue"=>"Che vuoi dire? Arlan, te lo do subio."],
14089=>["Value"=>14089,"TextKey"=>"剧情ID4060121","TextValue"=>"Nessun problema!"],
14090=>["Value"=>14090,"TextKey"=>"剧情ID4070101","TextValue"=>"Amergin, di' qualcosa!"],
14091=>["Value"=>14091,"TextKey"=>"剧情ID4070102","TextValue"=>"Devi venire a cercarmi..."],
14092=>["Value"=>14092,"TextKey"=>"剧情ID4070103","TextValue"=>"Questa volta funziona. La tua vice non sembra più strana come Meg quando finge di tossire."],
14093=>["Value"=>14093,"TextKey"=>"剧情ID4070104","TextValue"=>"Meg è anziana."],
14094=>["Value"=>14094,"TextKey"=>"剧情ID4070105","TextValue"=>"Come vuoi…"],
14095=>["Value"=>14095,"TextKey"=>"剧情ID4070106","TextValue"=>"Ho raggiunto il vulcano, ma non ho idea di cosa sia successo dopo. Quando mi sono svegliato, ero già in questo dannato posto, qualunque esso sia."],
14096=>["Value"=>14096,"TextKey"=>"剧情ID4070107","TextValue"=>"Anche se l'altare mi può contattare, immagino non possa trasportarvi qui dove sono..."],
14097=>["Value"=>14097,"TextKey"=>"剧情ID4070108","TextValue"=>"Anche se posso sentire Enda e risponderle, questo posto... decisamente non farà lo stesso e si nasconderà."],
14098=>["Value"=>14098,"TextKey"=>"剧情ID4070109","TextValue"=>"Idee?"],
14099=>["Value"=>14099,"TextKey"=>"剧情ID4070110","TextValue"=>"Entra in simbiosi con l'ambiente... per sempre... e forma un cerchio."],
14100=>["Value"=>14100,"TextKey"=>"剧情ID4070111","TextValue"=>"Che intendi? Lasciare che le fiamme raggiungano la cella frigorifera in cui ti trovi?"],
14101=>["Value"=>14101,"TextKey"=>"剧情ID4070112","TextValue"=>"Testa di legno, certo che no!"],
14102=>["Value"=>14102,"TextKey"=>"剧情ID4070113","TextValue"=>"Un cerchio... Lascia che la lava scorra e crei le ceneri, che le ceneri si solidifichino in rocce, e che dalle rocce erutti nuovamente la lava."],
14103=>["Value"=>14103,"TextKey"=>"剧情ID4070114","TextValue"=>"Sei davvero uno studente modello."],
14104=>["Value"=>14104,"TextKey"=>"剧情ID4070115","TextValue"=>"Aspetta!"],
14105=>["Value"=>14105,"TextKey"=>"剧情ID4080101","TextValue"=>"È una... testa di maiale?"],
14106=>["Value"=>14106,"TextKey"=>"剧情ID4080102","TextValue"=>"Eh già."],
14107=>["Value"=>14107,"TextKey"=>"剧情ID4080103","TextValue"=>"Con tutto il rispetto, perché ha la forma di una testa di maiale?"],
14108=>["Value"=>14108,"TextKey"=>"剧情ID4080104","TextValue"=>"Un momento, non dovrei fare questa domanda."],
14109=>["Value"=>14109,"TextKey"=>"剧情ID4080105","TextValue"=>"Dea! I miei amati compagni sono chiamati alla strada per il successo. Perché non lasciamo qui il mio compagno?"],
14110=>["Value"=>14110,"TextKey"=>"剧情ID4080106","TextValue"=>"Guarda come è carina la nostra sacerdotessa! Ha un modo così fine di essere carina. "],
14111=>["Value"=>14111,"TextKey"=>"剧情ID4080107","TextValue"=>"Tu!"],
14112=>["Value"=>14112,"TextKey"=>"剧情ID4080108","TextValue"=>"Fuori dai piedi, io e il capo stiamo per far partire l'altare."],
14113=>["Value"=>14113,"TextKey"=>"剧情ID4090101","TextValue"=>"Sigh... Enda, si va in scena."],
14114=>["Value"=>14114,"TextKey"=>"剧情ID4090102","TextValue"=>"Amergin è…"],
14115=>["Value"=>14115,"TextKey"=>"剧情ID4090103","TextValue"=>"Nell'estremo oriente... in un luogo ghiacciato e proibito."],
14116=>["Value"=>14116,"TextKey"=>"剧情ID4090104","TextValue"=>"Anche se qui si muore di caldo, credo che dovremmo iniziare a preparare i vestiti invernali."],
14117=>["Value"=>14117,"TextKey"=>"剧情ID99990101","TextValue"=>"That fog looks more suspicious than any crisis I have resolved since the establishment of the Royal Kingdom ever."],
14118=>["Value"=>14118,"TextKey"=>"剧情ID99990102","TextValue"=>"And it seems we are kind of stuck here. Hmmm, anybody here?"],
14119=>["Value"=>14119,"TextKey"=>"剧情ID99990103","TextValue"=>"Not a soul? Guess we have to figure out how to clear the fog all by ourselves."],
14120=>["Value"=>14120,"TextKey"=>"剧情ID47990201","TextValue"=>"Hey! Well done! The wheat appeared for a reason! "],
14121=>["Value"=>14121,"TextKey"=>"剧情ID99990202","TextValue"=>"Let's harvest some first and then see what can we do with them!"],
14122=>["Value"=>14122,"TextKey"=>"剧情ID99990301","TextValue"=>"Oh! A little spellbook! It appeared all of a sudden after I had the bread."],
14123=>["Value"=>14123,"TextKey"=>"剧情ID99990302","TextValue"=>"The fog seems thinned a bit because of the spellbook… Maybe we can use the spellbook to clear the fog away."],
14124=>["Value"=>14124,"TextKey"=>"剧情ID34990101","TextValue"=>"Great! Now let's make a plan: merge ingredients, cook foods, get spellbooks, and last but most importantly -- clear fog!"],
14125=>["Value"=>14125,"TextKey"=>"剧情ID99990601","TextValue"=>"Ha! What's that? Looks like there is a chest buried under those broken stones."],
14126=>["Value"=>14126,"TextKey"=>"剧情ID99990602","TextValue"=>"Let's open it at once and see what's inside! I can't wait to tell my friends about all this!"],
14127=>["Value"=>14127,"TextKey"=>"剧情ID99990701","TextValue"=>"It seems we have to stay here for a little while. We should make use of these stones and build a shelter."],
14128=>["Value"=>14128,"TextKey"=>"剧情ID99990702","TextValue"=>"We did it! Indeed, whatever magic in that spellbook certainly worked!"],
14129=>["Value"=>14129,"TextKey"=>"剧情ID99991001","TextValue"=>"I'm curious about what's gonna happen if we merge 5 items of the same kind at once."],
14130=>["Value"=>14130,"TextKey"=>"剧情ID99991002","TextValue"=>"I think we should give it a go. It seems like something wonderful might follow…"],
14131=>["Value"=>14131,"TextKey"=>"剧情ID99990801","TextValue"=>"What's this?"],
14132=>["Value"=>14132,"TextKey"=>"剧情ID99990802","TextValue"=>"It looks like nothing but ruins. But in a very short time, I promise my brother and I can build a perfect base for a stone castle! "],
14133=>["Value"=>14133,"TextKey"=>"剧情ID99990803","TextValue"=>"Right on! The most urgent affair should be constructing a solid castle to shield us against unknown challenges."],
14134=>["Value"=>14134,"TextKey"=>"剧情ID99990501","TextValue"=>"This hat is beaming faint magic."],
14135=>["Value"=>14135,"TextKey"=>"剧情ID99990502","TextValue"=>"Keep merging! I think this might be a clue that leads us to the right man to help us!"],
14136=>["Value"=>14136,"TextKey"=>"剧情ID99990901","TextValue"=>"What is this magical base with four slots on top? Looks like we need something to activate it!"],
14137=>["Value"=>14137,"TextKey"=>"剧情ID99990902","TextValue"=>"Your Majesty, this is a base for a castle. As long as we build the corresponding houses and place them on top of it, we can easily construct our Royal Castle."],
14138=>["Value"=>14138,"TextKey"=>"剧情ID99990903","TextValue"=>"We will remind you to place those houses on top after we finished construction."],
14139=>["Value"=>14139,"TextKey"=>"剧情ID99991101","TextValue"=>"I can't wait to find out what kind of mysterious treasure is hidden inside."],
14140=>["Value"=>14140,"TextKey"=>"剧情ID99991102","TextValue"=>"We can use it to to merge with stone  resources. Then we can have unlimited stones!"],
14141=>["Value"=>14141,"TextKey"=>"剧情ID99991201","TextValue"=>"Very helpful magic crystal! It can be played as anything you want!"],
14142=>["Value"=>14142,"TextKey"=>"剧情ID99991202","TextValue"=>"With it, you only need 2, not 3, of the same item to merge! Try using it!"],
14143=>["Value"=>14143,"TextKey"=>"剧情ID99991203","TextValue"=>"Remember the Magic Crystal can substitute any item you need in game!"],
14144=>["Value"=>14144,"TextKey"=>"剧情ID30400301","TextValue"=>"Look at this little cute stone frame!"],
14145=>["Value"=>14145,"TextKey"=>"剧情ID30400302","TextValue"=>"Compared to my finest architecture, this is far from close. Come on, Watt! We need more stone bricks!"],
14146=>["Value"=>14146,"TextKey"=>"剧情ID30400401","TextValue"=>"Not bad! You built a door with stones."],
14147=>["Value"=>14147,"TextKey"=>"剧情ID30400402","TextValue"=>"Thanks for your kind words. Please give us more time, we can surely build something better!"],
14148=>["Value"=>14148,"TextKey"=>"剧情ID30400501","TextValue"=>"You guys are indeed excellent stonecutter!"],
14149=>["Value"=>14149,"TextKey"=>"剧情ID30400601","TextValue"=>"Wally and I have constructed a much bigger stone house. I have to say that the arduous efforts we had made totally paid back."],
14150=>["Value"=>14150,"TextKey"=>"剧情ID30400602","TextValue"=>"You sure did! Now, I need a high tower to watch the remote lands."],
14151=>["Value"=>14151,"TextKey"=>"剧情ID30400701","TextValue"=>"With only four more houses like this, I can finally have a Castle on this land."],
14152=>["Value"=>14152,"TextKey"=>"剧情ID30400801","TextValue"=>"Castle completed! We can see it as a treasure box!"],
14153=>["Value"=>14153,"TextKey"=>"剧情ID30400802","TextValue"=>"That's right! There are so many goodies inside the Castle."],
14154=>["Value"=>14154,"TextKey"=>"剧情ID31610301","TextValue"=>"The power of the magic hat is greatly boosted! We should find its master for they must a mighty warlock!"],
14155=>["Value"=>14155,"TextKey"=>"剧情ID31610401","TextValue"=>"Humpf! A rabbit!"],
14156=>["Value"=>14156,"TextKey"=>"剧情ID31610402","TextValue"=>"Haha. Yup! If you have fresh and juicy carrots, don't forget my name… Oh, that will be Morris."],
14157=>["Value"=>14157,"TextKey"=>"剧情ID31610403","TextValue"=>"Morris, then you are destined to join my army! Speaking of the knowledge of delicacies, I'm second to none in the whole Hill Kingdom."],
14158=>["Value"=>14158,"TextKey"=>"剧情ID30410301","TextValue"=>"There are logs. We can build a much more comfortable house."],
14159=>["Value"=>14159,"TextKey"=>"剧情ID30410302","TextValue"=>"Cool. Take it slow this time. There is still time till the cold season creeps."],
14160=>["Value"=>14160,"TextKey"=>"剧情ID30410401","TextValue"=>"A decent ceiling at last."],
14161=>["Value"=>14161,"TextKey"=>"剧情ID30410402","TextValue"=>"Keep going! My fireplace is missing a chimney."],
14162=>["Value"=>14162,"TextKey"=>"剧情ID30410501","TextValue"=>"Why don't we build a lovely attic to reserve all my yummy carrots? They are the best foods in winter."],
14163=>["Value"=>14163,"TextKey"=>"剧情ID30410502","TextValue"=>"Haha, aren't carrots the best foods in all four seasons to you, Morris?"],
14164=>["Value"=>14164,"TextKey"=>"剧情ID30410601","TextValue"=>"I think I can use some more space to equip my little magic widgets."],
14165=>["Value"=>14165,"TextKey"=>"剧情ID30410602","TextValue"=>"The frame structure I designed is perfect for a bigger house."],
14166=>["Value"=>14166,"TextKey"=>"剧情ID30410701","TextValue"=>"What a beautiful house! Watt and Wally, I didn't expect your woodwork skills to be equally excellent!"],
14167=>["Value"=>14167,"TextKey"=>"剧情ID30410801","TextValue"=>"I can't believe one can actually build an outstanding architecture with zero magic spell cast."],
14168=>["Value"=>14168,"TextKey"=>"剧情ID30410802","TextValue"=>"My brother is an expert in architecture design. As for me… I'm good at being a cheerleader."],
14169=>["Value"=>14169,"TextKey"=>"剧情ID30410803","TextValue"=>"Watt, we need to catch up!"],
14170=>["Value"=>14170,"TextKey"=>"剧情ID30410901","TextValue"=>"Behold! A warm and cozy castle is ready!"],
14171=>["Value"=>14171,"TextKey"=>"剧情ID30410902","TextValue"=>"Nice! It is warm in winter and cool in summer! I suggest you prepare some hot biscuits for afternoon tea in winter times."],
14172=>["Value"=>14172,"TextKey"=>"剧情ID30410903","TextValue"=>"Or some carrot cakes and loaves of bread."],
14173=>["Value"=>14173,"TextKey"=>"剧情ID31620301","TextValue"=>"Morris, who would need these many harps?"],
14174=>["Value"=>14174,"TextKey"=>"剧情ID31620302","TextValue"=>"Ummm, I can't think of anyone. But this person must be a musician!"],
14175=>["Value"=>14175,"TextKey"=>"剧情ID31620401","TextValue"=>"I feel the power within these harps continues to grow."],
14176=>["Value"=>14176,"TextKey"=>"剧情ID31620501","TextValue"=>"These harps can be the best sword for a musician. So, can it keep leveling up?"],
14177=>["Value"=>14177,"TextKey"=>"剧情ID31620601","TextValue"=>"I can almost see the grandness of this harp being played in a luxurious music hall of the House of Hill."],
14178=>["Value"=>14178,"TextKey"=>"剧情ID31620602","TextValue"=>"I believe the owner of this harp will be given such a chance."],
14179=>["Value"=>14179,"TextKey"=>"剧情ID31620701","TextValue"=>"I'm Ramble, your humble servant. I have one more thing to celebrate in songs!"],
14180=>["Value"=>14180,"TextKey"=>"剧情ID31620702","TextValue"=>"Umm, can someone please make me an Icecream Muffin? I'm sure your beautiful music will be a perfect combo to it, which is even better than cinnamon powder!"],
14181=>["Value"=>14181,"TextKey"=>"剧情ID31620703","TextValue"=>"*In the arc music hall, in the breezy spring fields, in the presence of the one, whom the hymn gives*"],
14182=>["Value"=>14182,"TextKey"=>"剧情ID30420401","TextValue"=>"I quite like this exquisite door. Well, perhaps a wind vane will be needed over the sea?"],
14183=>["Value"=>14183,"TextKey"=>"剧情ID30420501","TextValue"=>"Ohh, it so reminds me of those old adventure days. Listen, we need to increase the height of the base. Y'all know waves crashing is no kidding."],
14184=>["Value"=>14184,"TextKey"=>"剧情ID30420601","TextValue"=>"Pretty good! Wally, you are no doubt a genius!"],
14185=>["Value"=>14185,"TextKey"=>"剧情ID30420602","TextValue"=>"Haha, Wally never fails you! And... since I've known him for my life, it's far from the time to celebrate."],
14186=>["Value"=>14186,"TextKey"=>"剧情ID30420701","TextValue"=>"Praise be to the brilliant craftsman! And what else do we need… bright lights dancing in the dark night, becoming the only beacon to the travelers."],
14187=>["Value"=>14187,"TextKey"=>"剧情ID30420801","TextValue"=>"What a wonderful boathouse! With only a couple more like this, our cruise ship will be ready to set sail!"],
14188=>["Value"=>14188,"TextKey"=>"剧情ID30420901","TextValue"=>"I can hear the waves beating and I can smell the storm coming! How exciting!"],
14189=>["Value"=>14189,"TextKey"=>"剧情ID30420902","TextValue"=>"Haha, check out Ramble's dreaming about adventures already! Watt and Wally, you two are indeed the best craftsmen ever!"],
14190=>["Value"=>14190,"TextKey"=>"剧情ID30420903","TextValue"=>"Thanks for your appreciation, Your Majesty! This boat castle also means our strength is greatly enhanced! "],
14191=>["Value"=>14191,"TextKey"=>"剧情ID31630301","TextValue"=>"That drum grew taller, looking like it's for an adult now! I want to jam a little bit, lol!"],
14192=>["Value"=>14192,"TextKey"=>"剧情ID31630401","TextValue"=>"In my opinion, a belt is needed for the drum. That'll be protective to the drumhead."],
14193=>["Value"=>14193,"TextKey"=>"剧情ID31630501","TextValue"=>"How about a fixation on the drum frame? Ramble knows musicians like him will get so carried away during the performance. It'll be a shame if it goes broken."],
14194=>["Value"=>14194,"TextKey"=>"剧情ID31630502","TextValue"=>"Correct. I should count how many harps I've played. One, two, three, four…"],
14195=>["Value"=>14195,"TextKey"=>"剧情ID31630601","TextValue"=>"The feather decoration looks very cute and unique. What do you think, Ramble?"],
14196=>["Value"=>14196,"TextKey"=>"剧情ID31630602","TextValue"=>"Yeah… but it might get in the way while playing. It's better to change the décor's location."],
14197=>["Value"=>14197,"TextKey"=>"剧情ID31630701","TextValue"=>"Now, it won't bother beating the drum. "],
14198=>["Value"=>14198,"TextKey"=>"剧情ID31630702","TextValue"=>"But the original simplicity and delicate beauty are weakened. Ramble, do you think you can improve that?"],
14199=>["Value"=>14199,"TextKey"=>"剧情ID31630801","TextValue"=>"Did you guys find my drum? Thanks!"],
14200=>["Value"=>14200,"TextKey"=>"剧情ID31630802","TextValue"=>"What a lovely wee lass!"],
14201=>["Value"=>14201,"TextKey"=>"剧情ID31630803","TextValue"=>"*Giggles* Thank you. I'm Melody, feel free to call me Mel! I have no idea why I woke up here in the fog."],
14202=>["Value"=>14202,"TextKey"=>"剧情ID31630804","TextValue"=>"That happened to everybody. Mel, glad you are joining us in this adventure!"],
14203=>["Value"=>14203,"TextKey"=>"剧情ID30430301","TextValue"=>"Beautiful pearl! I always want one, even though it doesn't have any function."],
14204=>["Value"=>14204,"TextKey"=>"剧情ID30430302","TextValue"=>"I know you'll like it! Well, Mel, we can build a pearl house next."],
14205=>["Value"=>14205,"TextKey"=>"剧情ID30430401","TextValue"=>"Wally is so creative! Pearl rooftop will be beautiful, but wouldn't that be too fragile?"],
14206=>["Value"=>14206,"TextKey"=>"剧情ID30430501","TextValue"=>"Dearest Watt and Wally, can you build it more spacious? More space is needed to stock pearls and shells."],
14207=>["Value"=>14207,"TextKey"=>"剧情ID30430502","TextValue"=>"One sec."],
14208=>["Value"=>14208,"TextKey"=>"剧情ID30430601","TextValue"=>"How about adding some seaweeds as décor?"],
14209=>["Value"=>14209,"TextKey"=>"剧情ID30430701","TextValue"=>"Stunning! Hahaha, I'm so happy. Can't stop smiling whenever I see the pearl house."],
14210=>["Value"=>14210,"TextKey"=>"剧情ID30430702","TextValue"=>"Aww, Mel, wait a sec. I stole — I mean, borrowed the design sketch from Wally."],
14211=>["Value"=>14211,"TextKey"=>"剧情ID30430801","TextValue"=>"Wow! There are two spires! This landscape is so glorious that I haven't seen it even in my most unstrained dream!"],
14212=>["Value"=>14212,"TextKey"=>"剧情ID30430802","TextValue"=>"It only takes four mansions like this to build a top-notch castle."],
14213=>["Value"=>14213,"TextKey"=>"剧情ID30430901","TextValue"=>"What do you think? Not bad, right? I knew Mel would love those spires."],
14214=>["Value"=>14214,"TextKey"=>"剧情ID30430902","TextValue"=>"Can I look around? Alrighty! I'm coming in! Aha, where's my drum? I want to drop some beats."],
14215=>["Value"=>14215,"TextKey"=>"剧情ID30430903","TextValue"=>"Let me be your accompany, Mel."],
14216=>["Value"=>14216,"TextKey"=>"剧情ID31640301","TextValue"=>"This crown should belong to someone important. Your Majesty, does that ring any bells?"],
14217=>["Value"=>14217,"TextKey"=>"剧情ID31640302","TextValue"=>"I'm not sure. It doesn't have the Royal Lable of House Hill. So, I really can't think of anyone who it belongs."],
14218=>["Value"=>14218,"TextKey"=>"剧情ID31640401","TextValue"=>"Magnificent gold, workmanship glowed. Used as a symbol in poems, represent power the most."],
14219=>["Value"=>14219,"TextKey"=>"剧情ID31640501","TextValue"=>"Inlaid with emerald, ha, very much in line with my Queen's aesthetic!"],
14220=>["Value"=>14220,"TextKey"=>"剧情ID31640601","TextValue"=>"What? Morris just told me such a luxurious crown is not even superior!"],
14221=>["Value"=>14221,"TextKey"=>"剧情ID31640602","TextValue"=>"Yup. I can feel the magic power hidden in the crown is far from the upper limit."],
14222=>["Value"=>14222,"TextKey"=>"剧情ID31640701","TextValue"=>"When the crown's owner came, I wonder if I could borrow to try it on? It is sooooo pretty!"],
14223=>["Value"=>14223,"TextKey"=>"剧情ID31640801","TextValue"=>"My! I can feel the magic is vibrating intensely. Its owner will soon arrive!"],
14224=>["Value"=>14224,"TextKey"=>"剧情ID31640901","TextValue"=>"Oh my goodness! Hill, my old pal!"],
14225=>["Value"=>14225,"TextKey"=>"剧情ID31640902","TextValue"=>"No way! I can't believe you are stuck here too! Oi oi, everyone! Let me introduce the King of Lion, Simba."],
14226=>["Value"=>14226,"TextKey"=>"剧情ID31640903","TextValue"=>"I have made a preliminary judgment about the surroundings here. There's no time to delay. Keep constructing and expanding territory."],
14227=>["Value"=>14227,"TextKey"=>"剧情ID30440301","TextValue"=>"This shabby wagon can barely shelter me from the wind and rain."],
14228=>["Value"=>14228,"TextKey"=>"剧情ID30440302","TextValue"=>"Lion King, you are right. We still need more time."],
14229=>["Value"=>14229,"TextKey"=>"剧情ID30440401","TextValue"=>"It is basic. However, that's a great model for further processing."],
14230=>["Value"=>14230,"TextKey"=>"剧情ID30440402","TextValue"=>"Improve the driver's seat. The long journey shall not be easy."],
14231=>["Value"=>14231,"TextKey"=>"剧情ID30440501","TextValue"=>"Nice! Guest seats also need to be improved. Watt and Wally, can you two please do us one more favor?"],
14232=>["Value"=>14232,"TextKey"=>"剧情ID30440601","TextValue"=>"Woohoo! Comfort level considerably increased. Well, I say we build it more confined. Privacy is no lesser than safety. Simba, I only suggested it because of our cooperation last time."],
14233=>["Value"=>14233,"TextKey"=>"剧情ID30440701","TextValue"=>"Indeed excellent! I've heard about your craftmanship, Watt and Wally. Too bad my lions only have fluffy paws, and this kind of delicate work is no match for lions."],
14234=>["Value"=>14234,"TextKey"=>"剧情ID30440702","TextValue"=>"Lol! Thanks for your appreciation, Lion King! There's still room for improvement. Wait and see what happens!"],
14235=>["Value"=>14235,"TextKey"=>"剧情ID30440801","TextValue"=>"Wally, can you add another story to it? The magic circulation requires height."],
14236=>["Value"=>14236,"TextKey"=>"剧情ID30440802","TextValue"=>"Gotcha! High-ceiling design is my expertise."],
14237=>["Value"=>14237,"TextKey"=>"剧情ID30440901","TextValue"=>"Watt and Wally, do you want to follow me to my Kingdom after all this? I guarantee that you will be treated even better than in Kingdom Hill."],
14238=>["Value"=>14238,"TextKey"=>"剧情ID30440902","TextValue"=>"Simba, I'm right here! I thought you would at least avoid me while poaching my staff!"],
14239=>["Value"=>14239,"TextKey"=>"剧情ID30441001","TextValue"=>"This castle means a lot to me. It allows me to live the spontaneous life I love and takes me to wherever I want."],
14240=>["Value"=>14240,"TextKey"=>"剧情ID30441002","TextValue"=>"Simba has been running freely over the fields. No wonder he wants a mobile castle to live in."],
14241=>["Value"=>14241,"TextKey"=>"剧情ID30441003","TextValue"=>"Watt and Wally, please take serious consideration into the advice I gave earlier."],
14242=>["Value"=>14242,"TextKey"=>"剧情ID31650301","TextValue"=>"Wow! It's getting better! But the portion for me is still too small."],
14243=>["Value"=>14243,"TextKey"=>"剧情ID31650401","TextValue"=>"The magic around the foods and the table are filling up. "],
14244=>["Value"=>14244,"TextKey"=>"剧情ID31650501","TextValue"=>"I'm a carnivore. But I know Hill's a sweet tooth. If you stay out of mine, I'll stay out of yours."],
14245=>["Value"=>14245,"TextKey"=>"剧情ID31650601","TextValue"=>"This reminds me of the old times when I host banquets. Though we are a little short of number, we can surely prepare a big meal for dinner tonight!"],
14246=>["Value"=>14246,"TextKey"=>"剧情ID31650701","TextValue"=>"This symbolized a fairy evening."],
14247=>["Value"=>14247,"TextKey"=>"剧情ID31650801","TextValue"=>"The magic is reaching the pinnacle. We can soon meet the owner of these yummy visions. "],
14248=>["Value"=>14248,"TextKey"=>"剧情ID31650901","TextValue"=>"…"],
14249=>["Value"=>14249,"TextKey"=>"剧情ID31650902","TextValue"=>"Hiya, lovely girl! What's your name?"],
14250=>["Value"=>14250,"TextKey"=>"剧情ID31650903","TextValue"=>"I… ummmm... I don't have a name. They call me "Little Match Girl". Perhaps… maybe... you can call me "Match"?"],
14251=>["Value"=>14251,"TextKey"=>"剧情ID31650904","TextValue"=>"Okay. Don't be afraid, kid. Come in and warm yourself up in our castle."],
14252=>["Value"=>14252,"TextKey"=>"剧情ID30450301","TextValue"=>"What's up, Match. Is this matchbox something you are thinking of?"],
14253=>["Value"=>14253,"TextKey"=>"剧情ID30450302","TextValue"=>"Yes, yes! If I curl up, I can squeeze myself in it, protecting myself against the wind."],
14254=>["Value"=>14254,"TextKey"=>"剧情ID30450401","TextValue"=>"Thank you, Watt! I can't imagine I can own a hut with beams one day. So happy!"],
14255=>["Value"=>14255,"TextKey"=>"剧情ID30450501","TextValue"=>"I can actually stand up inside the house. No more curling up. Hooray!"],
14256=>["Value"=>14256,"TextKey"=>"剧情ID30450601","TextValue"=>"Match, I think you'll like this windproof curtain."],
14257=>["Value"=>14257,"TextKey"=>"剧情ID30450602","TextValue"=>"Totally! I can save some matches to warm up now."],
14258=>["Value"=>14258,"TextKey"=>"剧情ID30450701","TextValue"=>"Ta-da~ The high-ceiling design I'm best at!"],
14259=>["Value"=>14259,"TextKey"=>"剧情ID30450702","TextValue"=>"Thank you so much! This is the prettiest house I've ever seen in my life… even better than those rich people's houses on the streets in the past."],
14260=>["Value"=>14260,"TextKey"=>"剧情ID30450801","TextValue"=>"If you can come up with one request for the house, what would it be?"],
14261=>["Value"=>14261,"TextKey"=>"剧情ID30450802","TextValue"=>"Ahhh… Owning a house is already beyond my expectation. I don't have any requests."],
14262=>["Value"=>14262,"TextKey"=>"剧情ID30450803","TextValue"=>"Not with that attitude, Match! C'mon, think harder! What do you really really really want?"],
14263=>["Value"=>14263,"TextKey"=>"剧情ID30450804","TextValue"=>"Umm… I think… that will be warmth. Yeah! I want it to be super warm!"],
14264=>["Value"=>14264,"TextKey"=>"剧情ID30450901","TextValue"=>"As long as we build four mansions like this, Little Match Girl will have her private castle!"],
14265=>["Value"=>14265,"TextKey"=>"剧情ID30451001","TextValue"=>"Are you guys serious? … This beautiful castle… is MINE?"],
14266=>["Value"=>14266,"TextKey"=>"剧情ID30451002","TextValue"=>"Of course, my dear child! This land is full of dangers. That's why we should value our accommodations. "],
14267=>["Value"=>14267,"TextKey"=>"剧情ID30451003","TextValue"=>"Waaah… Thank you! Thank you all!"],
14268=>["Value"=>14268,"TextKey"=>"剧情ID30451004","TextValue"=>"Go take some proper rest and be ready for the upcoming challenges!"],
14269=>["Value"=>14269,"TextKey"=>"剧情ID31660301","TextValue"=>"Fixation was a great idea. However, can we change its frame to a modern design? It looks not so transparent now."],
14270=>["Value"=>14270,"TextKey"=>"剧情ID31660401","TextValue"=>"Who will be the lamp holder?"],
14271=>["Value"=>14271,"TextKey"=>"剧情ID31660501","TextValue"=>"The fire is getting so much more bright! Morris, do you agree?"],
14272=>["Value"=>14272,"TextKey"=>"剧情ID31660502","TextValue"=>"Indeed, Your Majesty. This is a sign of enhanced magic."],
14273=>["Value"=>14273,"TextKey"=>"剧情ID31660601","TextValue"=>"Is this… a pumpkin? *Sweet'o'pumpkin, spooky'o'night* It's a perfect plant for my serenade!"],
14274=>["Value"=>14274,"TextKey"=>"剧情ID31660701","TextValue"=>"A lovely pumpkin lamp. It can be used as a decorative ornament."],
14275=>["Value"=>14275,"TextKey"=>"剧情ID31660702","TextValue"=>"It's hard to tell that the magic power it possessed is quite remarkable."],
14276=>["Value"=>14276,"TextKey"=>"剧情ID31660801","TextValue"=>"Did you guys notice that the impression of the pumpkin lamp just changed! It looks more and more like a human… Spooky..."],
14277=>["Value"=>14277,"TextKey"=>"剧情ID31660802","TextValue"=>"I have a hunch that this pumpkin friend will be meeting us soon."],
14278=>["Value"=>14278,"TextKey"=>"剧情ID31660901","TextValue"=>"Greetings, y'all! Ready for the spooky party at midnight?"],
14279=>["Value"=>14279,"TextKey"=>"剧情ID31660902","TextValue"=>"Pumpkinhead! Don't scare young kids. By the way, is your head ripe and sweet when you pick it?"],
14280=>["Value"=>14280,"TextKey"=>"剧情ID31660903","TextValue"=>"Ummm… actually pumpkins are not edible for they contain a toxic chemical called "pumpkin acid". And don't call me pumpkinhead, my name is Jack!"],
14281=>["Value"=>14281,"TextKey"=>"剧情ID31660904","TextValue"=>"Alright, Jack. That is a lie. Are you afraid I'm going to eat you?"],
14282=>["Value"=>14282,"TextKey"=>"剧情ID31660905","TextValue"=>"… See you, Mr. King!"],
14283=>["Value"=>14283,"TextKey"=>"剧情ID30460301","TextValue"=>"For me, straws are the best protection against cold."],
14284=>["Value"=>14284,"TextKey"=>"剧情ID30460401","TextValue"=>"Help me think… what are the things people might be startled at first glance? Oh right! Skeleton! I want to put a skeleton set on my front gate. "],
14285=>["Value"=>14285,"TextKey"=>"剧情ID30460501","TextValue"=>"Why don't you add something pumpkins to your façade? Just like what I did to mine with carrots."],
14286=>["Value"=>14286,"TextKey"=>"剧情ID30460601","TextValue"=>"Do you want to open a skylight, Mr. Jack? To do that, we have to take off the skeleton décor."],
14287=>["Value"=>14287,"TextKey"=>"剧情ID30460701","TextValue"=>"I really like it! But I feel that pumpkin can be bigger. Can you help me out?"],
14288=>["Value"=>14288,"TextKey"=>"剧情ID30460702","TextValue"=>"Sure thing. You can always trust Watt with carving."],
14289=>["Value"=>14289,"TextKey"=>"剧情ID30460801","TextValue"=>"Wow, soooooo beautiful! Hem hem, no, I mean… I still need a lantern on it! Yup, a lantern!"],
14290=>["Value"=>14290,"TextKey"=>"剧情ID30460901","TextValue"=>"This mansion looks like a large Jack! Hah-hah-hah, a small Jack living in a big Jack!"],
14291=>["Value"=>14291,"TextKey"=>"剧情ID30461001","TextValue"=>"Wow, my pumpkin, my straws, my lantern! Watt and Wally, you two are simply geniuses! I announce that you two are officially on top of my PRANKING LIST!"],
14292=>["Value"=>14292,"TextKey"=>"剧情ID30461002","TextValue"=>"Oh geez, cut me some slacks. But please do not let Watt escape!"],
